INSERT INTO attribute_desc VALUES(1,2,'en','(dt ⊗ K) = 0','Temporal geometry constraint','This field equation imposes a constraint on the temporal geometry, specifying that it remains unaffected by the Riemann curvature tensor ($K$ in Friedman).',NULL);
INSERT INTO attribute_desc VALUES(2,1,'en','1/r','Inverse of distance','Postulate from empirical observation: $E$ and $B$ drop off with distance at least as fast as $\frac{1}{r}$.',NULL);
INSERT INTO attribute_desc VALUES(3,2,'en','<1,3>','Signature for the metric tensor','We can have $g_{ij}=diag(1,-1,-1,-1)$ at any given point $p\in M$ (but not necessarily on any finite neighborhood of $p$) so long as $g$ has signature $\left\langle 1,3\right\rangle $. A semi-Riemannian manifold whose metric $g$ has this signature is called a Lorentzian manifld (hence, Minkowski space-time is just a flat Lorentzian manifold).',NULL);
INSERT INTO attribute_desc VALUES(3,1,'en','<1,3>','Signature','$g_{00}>0$ and $g_{ij}<0$ $(i,j, =1,2,3)$ everywhere.<br>$g_{ij}-(g_{0i}g_{0j}/g_{00})<0$ everywhere.<br>To ensure that $x^{0}$, or rather $(g_{00})^{\frac{1}{2}}\frac{x^{0}}{c}$, be a time coordinate and the others be space coordinates as required by GR 2.3.',NULL);
INSERT INTO attribute_desc VALUES(4,2,'en','<3,0,1>','Signature for the flat tensor h','$h_{p}$ has a 4x4 matrix of components $(h^{ij})$ in every coordinate system $\left\langle x_{i}\right\rangle $, and we can always find system in which $(h^{ij})$ is diagonalized with all diagonal elements equal to +1, -1, or zero. The triple  $\left\langle n_{+} n_{-},n_{0}\right\rangle $ where $n_{0}$ is the number of vanishing diagonal elements, is the signature of $h_{p}$.',NULL);
INSERT INTO attribute_desc VALUES(5,1,'en','Action','Action Principle','This is a declaration of the form $\partial S=0$ where $\partial S$ designates the first variation of a functional $S$ of a set of physical variables $q,q'',q''''$, … referring to to a physical system, where $S$ is a definite integral, $\partial q=0$ in the limits of integration and $\partial S=0$ implies physical laws, say equations of motion or field equations. ',NULL);
INSERT INTO attribute_desc VALUES(6,2,'en','Affine Connection','$\Gamma$: Affine connection','In the absence of a metric tensor field, A generalised connection for vector fields decomposes into irreducible components, where $B$ field is the traceless part of the torsion, $A_{\mu}$ is the trace of the torsion and $\hat{\Gamma}_{\left(\mu\nu\right)}^{\lambda}=\Gamma_{\mu\nu}^{\lambda}$ is a renaming of the symmetric part of the affine connection.',NULL);
INSERT INTO attribute_desc VALUES(6,1,'en','Affine Connection','Affine conexion: gravitational potentials','For every $\sigma\in \Sigma$ there exists a metric tensor $g$ whose associated metric affinity $\Gamma$ represents the strength of $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(7,1,'en','Algebra','Algebra','The study of mathematical symbols and variables, and the rules for manipulating them in formulas.',NULL);
INSERT INTO attribute_desc VALUES(8,1,'en','Analysis','Analysis','The branch of mathematics dealing with limits and related theories, such as differentiation, integration, measure, infinite series, and analytic functions.',NULL);
INSERT INTO attribute_desc VALUES(9,1,'en','Analytic Geometry','Analytic Geometry','The study of geometry using a coordinate system.',NULL);
INSERT INTO attribute_desc VALUES(10,1,'en','Analytical Dynamics','Analytical Dynamics','A class of theories partially interpreted that describe the evolution of physical systems.',NULL);
INSERT INTO attribute_desc VALUES(11,1,'en','Antecedence','Antecedence','If $A$ and $B$ are time-dependent properties and $A$ determines $B$ (whether causally or stochastically), then $B$ at time $t$ is a functional of $A$ at all times $t’$ prior to and up to $t$.',NULL);
INSERT INTO attribute_desc VALUES(12,1,'en','Applied Force','Applied force','Every $F^{e}\in\left\{ F^{e}\right\}$ is a real valued vector on $\Sigma\times K\times E^{3}\times T$.<br>The value of $F^{e}$ at any given 6-ple $\left\langle \sigma,k,x,t\right\rangle $ represents the external force acting on $\sigma$, relative to the frame $k$, at the place $x$ and the instant $t$.',NULL);
INSERT INTO attribute_desc VALUES(13,1,'en','Asymptotic Form','Asymptotic form','The components of $g$ approach constant values as the $x^{i}(i=1,2,3)$ tend to infinity.<br>The metric tensor, which solves the field equations, should represent an isolated system. Outside every $V\subset M^{4}$, the asymptotic forms of the components of $g$ are those of outgoing spherical waves.',NULL);
INSERT INTO attribute_desc VALUES(14,2,'en','B','$B$: Symmetric tensor field','The symmetric tensor field $B$ is typically associated with the presence of multiple metrics, which describe how distances and intervals are measured in different ways. In stratified and bimetric theories there might be two or more metrics to describe different aspects of gravity or spacetime such as variations in gravity''s strength or range. $B$ helps relate and reconcile these metrics, ensuring that the theory remains self-consistent.',NULL);
INSERT INTO attribute_desc VALUES(15,1,'en','Balance of Momentum','Law of balance of momentum','For every $\sigma\in\Sigma$, $t\in T$, every $\varrho\in\left\{ \varrho\right\} $, every $f_{b}\in\left\{ f_{b}\right\} $ and every $\mathrm{T\in\left\{ \mathrm{T}\right\} }$, there exists a $k\in K$ such that $\dot{p}=F$.',NULL);
INSERT INTO attribute_desc VALUES(16,1,'en','Bodies','Bodies','$\Sigma$ is a nonempty denumerable set.<br>Every $\Sigma$ is a body.',NULL);
INSERT INTO attribute_desc VALUES(17,1,'en','Body Force Density','Body force density','Every $f_{b}\in\left\{ f_{b}\right\} $ is a real and bounded vector field over $\beta\times K\times E^{3}\times T$.<br>If $b\hat{=}\sigma$, then $f_{b}(b,k,x,t)$ represents the force per unit volume on the body $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(18,1,'en','Body Stress','Body stress','Every $\mathrm{T\in\left\{ \mathrm{T}\right\} }$ is a real and bounded tensor field of valence (2,0) over $\beta\times K\times E^{3}\times T$.<br>If $b\hat{=}\sigma$, and $beta\hat{=}\pi$, then $\mathrm{T(\beta,K,x,t)}$ represents the body stress at the particle $\pi\dot{\in}\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(19,1,'en','Equivalence','Equivalence class of representations','Let $X''=a+QX$, with $a$ and $Q$ functions of time, represent a change of frame. Then<br>If $V$ is a vector referring to $\pi\dot{\in}\sigma\in\Sigma$, which upon a change of frame becomes $V’=QV$, then $V’$ and $V$ refer to the same physical situation.<br>If $S$ is a 2nd rank tensor referring to $\pi\dot{\in}\sigma\in\Sigma$, which upon a change of frame becomes $S''=QS\tilde{Q}$, where $\tilde{Q}$ is the transposed of $Q$, then $S’$ and $S$ refer to the same physical situation.',NULL);
INSERT INTO attribute_desc VALUES(20,1,'en','Charge Density','Charge density','$\left\{ \rho\right\} $ is a nonempty family of functions.<br>Every $\rho$ is a scalar valued function from $\beta\times M^{3}\times T$ to $\mathbb{R}$.<br>If $b\hat{=}\sigma$, then $\rho(b,x,t)$ represents the charge density of $\rho$ at $x$,$t$.',NULL);
INSERT INTO attribute_desc VALUES(21,1,'en','Charged Bodies','Charged bodies','$\Sigma$ is a nonempty set.<br>Every $\Sigma$ is a charged body.',NULL);
INSERT INTO attribute_desc VALUES(22,1,'en','Charged M Bodies','Charged bodies','$\left\{ \beta\right\} $ is a nonempty family of point sets.<br>Every $b\in\beta$ is a 3-dimensional differentiable manifold.<br>For every $\sigma\in\Sigma$ there exists a $b\in\beta$ such that $b\hat{=}\sigma$ pointwise.',NULL);
INSERT INTO attribute_desc VALUES(23,1,'en','Configuration Space','$Q$: Configuration space','A mathematical space that represents all possible configurations or positions of a system''s degrees of freedom. Each point in configuration space corresponds to a unique arrangement of these degrees of freedom, defining a specific state of the system.',NULL);
INSERT INTO attribute_desc VALUES(24,2,'en','Const < 0','$R=Const<0$','Ricci scalar is constant and negative at all points.',NULL);
INSERT INTO attribute_desc VALUES(25,2,'en','Const > 0','$R=Const>0$','Ricci scalar is constant and positive at all points.',NULL);
INSERT INTO attribute_desc VALUES(26,1,'en','Contiguity','Contiguity','If $A$ and $B$ are place-dependent properties and $A$ determines $B$ (whether causally of stochastically), then $B$ at the place $x$ is a functional of $A$ at all places $x’$ surrounding $x$. The value of the kernel $K$ represents the weight of the local contribution of $A$.',NULL);
INSERT INTO attribute_desc VALUES(27,1,'en','Coordinate Transformations','Coordinate transformations','All coordinate transformations in $M^{4}$ are bijective maps.<br>The Jacobian of every coordinate transformation vanishes nowhere.<br>Areas and volumes should not vanish upon coordinate transformations, for otherwise things themselves would appear to vanish by sheer paper and pencil operations.',NULL);
INSERT INTO attribute_desc VALUES(28,1,'en','Cotime','Cotime','For every $i$, $i''\in I$, the associated cotimes are such that $\frac{\partial X_{0}}{\partial X''_{0}}$ exists and is positive.',NULL);
INSERT INTO attribute_desc VALUES(29,2,'en','Curvature','$Riem(\Gamma)$: Riemann curvature tensor','The curvature tensor of an affine connection is a linear transformation-valued tensor field assigning a mapping to each pair of vectors at $p.$',NULL);
INSERT INTO attribute_desc VALUES(30,2,'en','Curvature = 0','Curvature = 0','Riemann’s curvature tensor of the affine connection is zero. Found as $K=0$ in Friedman.',NULL);
INSERT INTO attribute_desc VALUES(31,2,'en','D(V) = 0','Covariant constancy of V','Covariant derivative of the vector field V equals zero. It makes the lines in the rigging of space-time to be geodesics, meaning that V remains unchanged or constant as it moves along these paths.',NULL);
INSERT INTO attribute_desc VALUES(32,2,'en','D(dt) = 0','Flat simultaneity slices','Covariant derivative of $dt$ equals zero to ensure the simultaneity slices are flat.',NULL);
INSERT INTO attribute_desc VALUES(33,2,'en','D(g) = 0','Covariant constancy of the metric','The covariant derivative acting on the metric tensor vanishes. Condition that preserves angles and distances when parallel transporting vectors along a curve.',NULL);
INSERT INTO attribute_desc VALUES(34,2,'en','D(h) = 0','Constancy of the flat metric','Local field equation: the flat metric h is compatible with the flat connection $\overline{D}$, describing euclidean geometry.',NULL);
INSERT INTO attribute_desc VALUES(35,2,'en','Definite-Positive','Class of signature','The class of signature of the metric tensor is all positive $<+,+,+,+>$, characteristic of other mathematical and non-physical spaces.',NULL);
INSERT INTO attribute_desc VALUES(36,2,'en','Dependent','Dependency','The connection $\Gamma_{\mu\nu}^{\lambda}$  and the metric tensor $g_{\mu\nu}$  depend on each other.',NULL);
INSERT INTO attribute_desc VALUES(37,1,'en','Dimensional Analysis','Dimensional Analysis','The analysis that exhibits the genera to which a set of magnitudes belong.',NULL);
INSERT INTO attribute_desc VALUES(38,1,'en','E3','$E^{3}$: Euclidean physical space','$E^{3}$ is 3-dimensional  Euclidean space.<br>$E^{3}$ represents (maps) ordinary space.',NULL);
INSERT INTO attribute_desc VALUES(39,1,'en','E3R','$E^{3}R$: Euclidian relative space','$E^{3}$ is a tridimensional Euclidean space with inner product.<br>$E^{3}$ represents ordinary space relative to (as seen from) any given $i\subset I$). Special relativity adopts a classical concept of space as a container which "remains always similar and immovable" (Newton), but resticts it to every single frame.',NULL);
INSERT INTO attribute_desc VALUES(40,1,'en','EM Fields','Electromagnetic fields','$\Phi$ is a nonempty set.<br>Every $\Phi$ is an e.m. field.',NULL);
INSERT INTO attribute_desc VALUES(41,1,'en','EM Signals','Electromagnetic signals','$S\neq\emptyset$ and $S\subset\Sigma$.<br>Every $s\in S$ represents an electromagnetic signal.',NULL);
INSERT INTO attribute_desc VALUES(42,2,'en','Einstein’s Eq','Einstein’s field equation','It relates the curvature of space-time with the distribution of matter and energy within it. $\mathbf{Ric}$ is the Ricci curvature tensor, $R$ is the scalar curvature and $\mathbf{T}$ is the stress-energy-momentum tensor. ','Checar que en f-R la formulación es esta:    $G_{\mu\nu}=\frac{\kappa}{f’(R)}\left(T_{\mu\nu}+T_{\mu\nu}^{(eff)}\right)$');
INSERT INTO attribute_desc VALUES(42,1,'en','Einstein’s Eq','Einstein’s field equation','For every $x\in V$, every $\sigma\in\Sigma$, every $\bar{\sigma}\in\bar{\Sigma}$ and every $\mathrm{T\in\left\{ \mathrm{T}\right\} }$, there is a $g\in\{g\}$ such that<br>$G=\kappa\mathrm{T}$.',NULL);
INSERT INTO attribute_desc VALUES(43,1,'en','Electric Fields','Electric field intensity','$\left\{ E\right\} $ is a nonempty family of fields.<br>Every $E\in\left\{ E\right\} $ is a real and vector valued function of $\Phi\times M^{3}\times T$.<br>$E(\phi,x,t)$ represents the intensity of the electric component of $\phi$ at $x$,$t$.',NULL);
INSERT INTO attribute_desc VALUES(44,1,'en','Energy-momentum Tensor','Energy-momentum-stress tensor','$\mathrm{T}$ is a contravariant symmetric tensor field on $V\subset M^{4}$.<br>$\mathrm{T}$ represents the energy, momentum and stress of all the systems $\bar{\sigma}\in\bar{\Sigma}$ in $V$.',NULL);
INSERT INTO attribute_desc VALUES(45,1,'en','Eq 01','Eq 01: Newton’s Second Law','Newton''s second law of motion, which states that the rate of change of momentum of an object is equal to the net force acting on it. ',NULL);
INSERT INTO attribute_desc VALUES(46,1,'en','Eq 02','Eq 02: Hamilton''s Equations','These two equations describe the dynamics of a physical system in terms of generalized coordinates $q$ and their conjugate momenta $p$. The first one describes how the positions evolve in response to changes in momentum. The second one describes how the conjugate momenta $p$ change with time. It states that the rate of change of momentum $p$ is equal to the negative partial derivative of the Hamiltonian $H$ with respect to the corresponding generalized coordinate $q$.',NULL);
INSERT INTO attribute_desc VALUES(47,1,'en','Eq 03','Eq 03: Hamilton''s Equations','This equation represents the rate of change of a generalized coordinate $\Phi$ with time. This change is determined by the dot product of a generalized momentum vector $P$ and the gradient (nabla, $\nabla$) of the Hamiltonian function $H$. This equation is a fundamental element of Hamiltonian mechanics and describes how coordinates evolve in response to variations in momentum and the Hamiltonian energy function.',NULL);
INSERT INTO attribute_desc VALUES(48,1,'en','Eq 04','Eq 04: Hamilton-Jacobi Equation','This equation expresses the conservation of the action $S$ with respect to time $t$ in the Jacobian theory. It states that the rate of change of the action with respect to time, represented by the partial derivative $\frac{\partial S}{\partial t}$, is equal to minus the Hamiltonian $H$ of the system. In other words, it asserts that the total action of the system, when combined with the Hamiltonian, remains constant over time. ',NULL);
INSERT INTO attribute_desc VALUES(49,1,'en','Eq 05','Eq 05: Euler-Lagrange equation','This equation describes the dynamics of a physical system. It states that the time derivative of the partial derivative of the Lagrangian function $L$ with respect to the generalized velocity $q̇$ minus the partial derivative of the Lagrangian with respect to the generalized coordinate $q$ is equal to zero.',NULL);
INSERT INTO attribute_desc VALUES(50,2,'en','Eq 13M','Eq 13M','Field equation for MoND local F(R,T).','(Pending) ');
INSERT INTO attribute_desc VALUES(51,2,'en','Eq 13','Palatini action','The metric and connection are independent. Variation not on the connection. Note the new Ricci tensor is constructed with an independent connection:  $\Re=g_{\mu\nu}R_{\mu\nu}$.',NULL);
INSERT INTO attribute_desc VALUES(52,2,'en','Eq 14M','Eq 14M','Field equation for Mond non local pure Metric.',NULL);
INSERT INTO attribute_desc VALUES(53,2,'en','Eq 18','Eq 18','Palatini field equation 1.',NULL);
INSERT INTO attribute_desc VALUES(54,2,'en','Eq 18M','Eq 18M','Equation of motion for MoNDian non local pure metric extended theory.',NULL);
INSERT INTO attribute_desc VALUES(55,2,'en','Eq 19','Eq 19','Palatini field equation 2. ($\bar{\nabla}_{\lambda}$) is the covariant derivative defined with the independent connection.',NULL);
INSERT INTO attribute_desc VALUES(56,2,'en','Eq 2M','Eq 2M','Equation of motion for the MoNDian non-local a la palatini extended theory.','(Pending) This is the wrong eq. number');
INSERT INTO attribute_desc VALUES(57,2,'en','Eq 37M','Eq 37M','Equation of motion for MoND F(R,T).',NULL);
INSERT INTO attribute_desc VALUES(58,2,'en','Eq 34M, 35M','Eq 34M, 35M','Equation of motion for MoND local pure metric.',NULL);
INSERT INTO attribute_desc VALUES(59,2,'en','Eq 4M','Eq 4M','Field equation for MoND local pure metric.',NULL);
INSERT INTO attribute_desc VALUES(60,2,'en','Eq 46','Eq 46','Field equation.',NULL);
INSERT INTO attribute_desc VALUES(61,2,'en','Eq 47','Eq 47','Field equation after varying independently with respect to the connection.',NULL);
INSERT INTO attribute_desc VALUES(62,2,'en','Eq 48','Eq 48','Field equation after varying independently with respect to the Lagrange multiplier.',NULL);
INSERT INTO attribute_desc VALUES(63,2,'en','Eq 5','Eq 5','Total action for a metric $f(R)$.',NULL);
INSERT INTO attribute_desc VALUES(64,2,'en','Eq 5-30','Eq 5-30','Action for scalar-tensor theories.',NULL);
INSERT INTO attribute_desc VALUES(65,2,'en','Eq 5-31','Eq 5-31','The field equation is derived from the action 5-30.',NULL);
INSERT INTO attribute_desc VALUES(66,2,'en','Eq 5-45','Eq 5-45','Action for vector-tensor theories',NULL);
INSERT INTO attribute_desc VALUES(67,2,'en','Eq 5-47','Eq 5-47','Field equations for Vector-Tensor theories.',NULL);
INSERT INTO attribute_desc VALUES(68,2,'en','Eq 5-67','Eq 5-67','Action Rosen Bimetric theory.',NULL);
INSERT INTO attribute_desc VALUES(69,2,'en','Eq 5-68','Eq 5-68','Field equation for Rosen’s theory.',NULL);
INSERT INTO attribute_desc VALUES(70,2,'en','Eq 5-73','Eq 5-73','Action Rastall Bimetric theory.',NULL);
INSERT INTO attribute_desc VALUES(71,2,'en','Eq 5-75','Eq 5-75','Field equation for Rastall’s theory.',NULL);
INSERT INTO attribute_desc VALUES(72,2,'en','Eq 5-82','Eq 5-82','Action for BSLL Bimetric theories.',NULL);
INSERT INTO attribute_desc VALUES(73,2,'en','Eq 5-84','Eq 5-84','Field equation for BSLL bimetric theory.',NULL);
INSERT INTO attribute_desc VALUES(74,2,'en','Eq 5-93','Eq 5-93','Action for stratified theories.',NULL);
INSERT INTO attribute_desc VALUES(75,2,'en','Eq 5-95','Eq 5-95','Field equation for stratified theories.',NULL);
INSERT INTO attribute_desc VALUES(76,2,'en','Eq 6','Eq 6','Field equation of metric  $f(R)$.',NULL);
INSERT INTO attribute_desc VALUES(77,2,'en','Eq 8M','Eq 8M','Field equation for MoND non local Palatini. The null variations of the action with respect to the metric yields this field equation where the dimensionless tensor is $\chi_{\mu\nu}:=L_{M}^{2}R_{\mu\nu}$ and $f''(\chi):=\frac{df(\chi)}{d\chi}$.',NULL);
INSERT INTO attribute_desc VALUES(78,2,'en','Eq 9a','Eq 9a','If the Ricci scalar $R=0$, then the field equation reduces to $R_{\mu\eta}=0$ and the maximally symmetric solution is Minkowski spacetime.',NULL);
INSERT INTO attribute_desc VALUES(79,2,'en','Eq 9b','Eq 9b','If the Ricci scalar is constant, then the field equation reduces to $R_{\mu\nu}=g_{\mu\nu}\frac{Const}{4}$, and the maximally symmetric solution is de Sitter or anti-de Sitter space depending on the sign of the constant.',NULL);
INSERT INTO attribute_desc VALUES(80,2,'en','Eq 9c','Eq 9c','If the Ricci scalar is constant, then the field equation reduces to $R_{\mu\nu}=g_{\mu\nu}\frac{Const}{4}$, and the maximally symmetric solution is de Sitter or anti-de Sitter space depending on the sign of the constant.','Checar redacción');
INSERT INTO attribute_desc VALUES(81,1,'en','Equipresence','Equipresence','An independent variable present in one constitutive equation is so present in all.',NULL);
INSERT INTO attribute_desc VALUES(82,1,'en','Euclidean Space','Euclidean space','$E^{3}$ is 3-dimensional  Euclidean space.<br>$E^{3}$ represents (maps) ordinary space.',NULL);
INSERT INTO attribute_desc VALUES(83,1,'en','External Force','External force','Every $F^{e}\in\left\{ F^{e}\right\}$ is a real valued vector on $\Sigma\times K\times E^{3}\times T$.<br>The value of $F^{e}$ at any given 6-ple $\left\langle \sigma,k,x,t\right\rangle $ represents the external force acting on $\sigma$, relative to the frame $k$, at the place $x$ and the instant $t$.',NULL);
INSERT INTO attribute_desc VALUES(84,1,'en','F = ma','Newton’s laws','For every $\sigma,\sigma''\in\Sigma$, every $t\in T$, every $F^{e}\in\left\{ F^{e}\right\}$ and every $F^{i}\in\left\{ F^{i}\right\}$, there is at least one $k\in K$ such that<br>$\dot{p}(\sigma,t,k)=F^{e}(\sigma,t,k)+\underset{\sigma’\neq\sigma}{\sum}F^{i}(\sigma,\sigma’,t,k)$<br>and<br>$F^{i}(\sigma,\sigma’,t,k)=-F^{i}(\sigma’,\sigma,t,k)$.',NULL);
INSERT INTO attribute_desc VALUES(85,2,'en','F(R*,Lm)','$F(\Re,L_{m})$','A class of action functions. The action is a function of the affine Ricci scalar and the matter Lagrangian.',NULL);
INSERT INTO attribute_desc VALUES(86,2,'en','F(R*,T)','$F(\Re,T_{\mu\nu})$','A class of action functions. The action is also a function of the affine Ricci scalar and the trace of the energy momentum tensor.',NULL);
INSERT INTO attribute_desc VALUES(87,2,'en','F(R,Lm)','$F(R,\mathcal{L}_{matt})$','A class of action functions. The action is a function of the Ricci scalar and the matter Lagrangian.',NULL);
INSERT INTO attribute_desc VALUES(88,2,'en','F(R,T)','$F(R,T_{\mu\nu})$',' A class of action functions. The action is a function of the Ricci scalar and the trace of the energy momentum tensor.',NULL);
INSERT INTO attribute_desc VALUES(89,1,'en','Field Theory','Field Theory','Any theory containing the mathematical concept of field (an extended imponderable that cannot be transformed away).',NULL);
INSERT INTO attribute_desc VALUES(90,2,'en','Flat Connection','$\overline{D}$: Flat connection','A derivative for flat spaces.',NULL);
INSERT INTO attribute_desc VALUES(91,1,'en','Force between Particles','Force between particles','Every $F^{i}\in\left\{ F^{i}\right\} $ is a real valued vector on $\Sigma\times\Sigma\times K\times E^{3}\times T$.<br>The value of $F^{i}$ at any given 7-ple $\left\langle \sigma,\sigma'',k,x,t\right\rangle $ represents the force extended by $\sigma''$ on $sigma$ relative to $k$ at $x$ and $t$.',NULL);
INSERT INTO attribute_desc VALUES(92,1,'en','E.M. Force Density','E.M. Force density','The force density exerted by an external field $\left\langle E,B\right\rangle \hat{=}\varphi\in\Phi$ on $\sigma\in \Sigma$ is<br>$f=\rho\left(E+\frac{v}{c}\times B\right)$.',NULL);
INSERT INTO attribute_desc VALUES(93,2,'en','G 5-101','Gravitational constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(94,2,'en','G 5-38','Gravitational constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(95,2,'en','G 5-61','Gravitational constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(96,2,'en','G 5-63','Gravitational constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(97,2,'en','G 5-65','Gravitational constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(98,2,'en','G 5-70','Gravitational constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(99,2,'en','G 5-89','Gravitational constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(100,2,'en','G = 1','Gravitational constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(101,1,'en','Components','Tipification for components of $\mathrm{T}$ ','The components of $\mathrm{T}$ are real valued functions of $\bar{\sigma}$, $k$, $X$ and $t$.<br>The components of $\mathrm{T}$ vanish outside $V$.',NULL);
INSERT INTO attribute_desc VALUES(102,1,'en','Frame equivalence','Coordinate frame equivalence','Two solutions of Einsteins’s equation which can be transformed into one another by an admissible coordinate transformation refer to the same field.',NULL);
INSERT INTO attribute_desc VALUES(103,1,'en','Galilian Invariance','Galilean Invariance','The basic laws of physics shall be invariant under transfomations of cooordinates representing changes of inertial (Galilean) frames.',NULL);
INSERT INTO attribute_desc VALUES(104,2,'en','General Action','Metric general action',NULL,NULL);
INSERT INTO attribute_desc VALUES(105,2,'en','General Action Palatini','Palatini general action',NULL,NULL);
INSERT INTO attribute_desc VALUES(106,1,'en','General Systems Theory','General Systems Theory','A set of interrelated concepts and principles applying to all systems.',NULL);
INSERT INTO attribute_desc VALUES(107,1,'en','General Covariance','General Covariance','The basic law statements of physics should hold in any frame of reference and in any coordinate system. They should be preserved under arbitrary changes in coordinate systems, whether or not the latter mirror different physical reference frames.',NULL);
INSERT INTO attribute_desc VALUES(108,2,'en','Geodesic Law','Geodesic law','Free particles follow timeline geodesics of the connection.',NULL);
INSERT INTO attribute_desc VALUES(109,1,'en','Gravitational Fields','Gravitational fields','$\Sigma$ is a nonempty set.<br>Every $\Sigma$ represents a gravitational field.',NULL);
INSERT INTO attribute_desc VALUES(110,2,'en','Gravitational Force','Gravitational force','Particles acted on only by gravitational forces follow non geodesic paths determined by the gravitational potential.',NULL);
INSERT INTO attribute_desc VALUES(111,2,'en','H2*K = H2*K','Symmetry property','This field equation indicates that the way space curves due to gravitational effects is the same, regardless of the order in which you consider different positions or coordinates.',NULL);
INSERT INTO attribute_desc VALUES(112,1,'en','Hamiltonian','Hamiltonian','A mathematical operator or function that encodes the total energy of a physical system. It is typically defined in terms of the system''s generalized coordinates and their conjugate momenta. The It represents the sum of the system''s kinetic and potential energies.',NULL);
INSERT INTO attribute_desc VALUES(113,2,'en','Hyp','Hypermomentum','A quantity representing the variation of $S_{M}$ with respect to the connection, which mimics the definition of the stress-energy tensor. ',NULL);
INSERT INTO attribute_desc VALUES(114,2,'en','Independent','Independency between variables','The connection $\Gamma_{\mu\nu}^{\lambda}$ may be expressed independently of the metric tensor $g_{\mu\nu}$.',NULL);
INSERT INTO attribute_desc VALUES(115,1,'en','Inertial Frame','Inertial reference frames','$I\neq\emptyset\land I\subset\Sigma-S$.<br>Every $i\in I$ is an inertial reference frame.<br>For every $i\in I$ there is a basis $e=\left\langle e_{1},e_{2}.e_{3}\right\rangle $ such that $e\hat{=}i$.',NULL);
INSERT INTO attribute_desc VALUES(116,1,'en','Interparticle Force','Inter-particle force','Every $F^{i}\in\left\{ F^{i}\right\} $ is a real valued vector on $\Sigma\times\Sigma\times K\times E^{3}\times T$.<br>The value of $F^{i}$ at any given 7-ple $\left\langle \sigma,\sigma'',k,x,t\right\rangle $ represents the force extended by $\sigma''$ on $sigma$ relative to $k$ at $x$ and $t$.',NULL);
INSERT INTO attribute_desc VALUES(117,1,'en','K','Physical reference frames','$K$ is a nonempty denumerable set.<br>Every $k$ is a rigid system of corpuscles at least four of which lie on the vertices of a regular trihedral.<br>For every $k$ there exists a Cartesian system of axes $e=\left\langle e_{1},e_{2}.e_{3}\right\rangle $ such that $e\hat{=}k$.<br>No $k$ interacts with any $\sigma\subset\Sigma$ that is not a part of $k$.<br>The configuration of every $k\in K$ is time-independent.',NULL);
INSERT INTO attribute_desc VALUES(119,2,'en','K0','$K_{0}$','Cosmological matching parameter.',NULL);
INSERT INTO attribute_desc VALUES(120,2,'en','Kappa1, Kappa2','Arbitrary functions',NULL,NULL);
INSERT INTO attribute_desc VALUES(121,2,'en','Km','$K^{\mu}$: Dynamical vector field','Timelike dynamic vector field.',NULL);
INSERT INTO attribute_desc VALUES(122,1,'en','Lagrangian','Lagrangian','A mathematical function that summarizes the dynamics of a physical system. It is typically defined as the difference between the system''s kinetic energy and potential energy, expressed in terms of the system''s generalized coordinates and their time derivatives.',NULL);
INSERT INTO attribute_desc VALUES(123,2,'en','lambda','$\lambda(\phi)$: Cosmological function','$\lambda(\phi)$ causes two effects: in the field equation for $g$ it plays the same role as the cosmological constant in GR, and, in the field equation, it gives $(\phi)$ a range l related to $\lambda$, $w$ and their derivatives, in the sense that the solutions for $(\phi)$ for an isolated system contain Yukawa-like terms $exp\left(-r/l\right)$.',NULL);
INSERT INTO attribute_desc VALUES(124,2,'en','lambda = 0','Cosmological function vanishes','Nordtvedt''s (1970b) scalar-tensor theory is equivalent to the Bergmann-Wagoner theory in the special case of zero cosmological function $\lambda\equiv0$.',NULL);
INSERT INTO attribute_desc VALUES(125,2,'en','Local','Locality','Matter is a point function. The action is a function of only the metric and a finite number of its derivatives.',NULL);
INSERT INTO attribute_desc VALUES(126,1,'en','Locality','Locality','For any point $x\in M^{4}$ there exists a neighborhood of $x$ over which a local coordinate system can be given such that $x^{0}$ is a (local) time coordinate and $x^{1}$, $x^{2}$ and $x^{3}$ are (local) spatial coordinates.<br>[Roughly: the tangent space of $M^{4}$ at any $x\in M^{4}$ is spacetime].',NULL);
INSERT INTO attribute_desc VALUES(127,1,'en','Logic','Logic','The systematic study of valid rules of inference, analysis and appraisal of arguments.',NULL);
INSERT INTO attribute_desc VALUES(128,1,'en','Lorentz Invariance','Lorentz Invariance','The basic laws of physics shall be invariant under Lorentz transfomations of cooordinates representing changes of inertial frames.',NULL);
INSERT INTO attribute_desc VALUES(129,2,'en','M','$M$: Differentiable manifold','1.- Space-time has topology: given any point $p$ in space-time, we have the notion of a neighborhood of $p$.<br>2.- Space-time is coordinatizable by $R^{4}$. This is a purely local assertion (space-time is locally euclidean).',NULL);
INSERT INTO attribute_desc VALUES(130,1,'en','M Bodies','Bodies','$\left\{ \beta\right\} $ is a nonempty family of point sets.<br>Every $b\in B$ is a 3-dimensional differentiable manifold.<br>For every $\sigma\in\Sigma$ there exists a $b\in\beta$ such that $b\hat{=}\sigma$ pointwise.',NULL);
INSERT INTO attribute_desc VALUES(131,1,'en','M3','Space','$M^{3}$ is a 3-dimensional  differentiable manifold.<br>$M^{3}$ represents physical space.',NULL);
INSERT INTO attribute_desc VALUES(132,1,'en','M4','$M^{4}$: 4D Manifold','$M^{4}$ is 4-dimensional differentiable manifold of class $C^{2}$.<br>For every point $x\subset M^{4}$, there exists a neighborhood of $x$ over which a local coordinate system can be given (defined).<br>the function s fmu that map neighboring coordinate sets onto one another are continuous and have continuous derivatives up to 2nd order in $M^{4}$.<br>$M^{4}$ represents physical space.',NULL);
INSERT INTO attribute_desc VALUES(133,1,'en','Magnetic Fields','Magnetic field intensity','Every $\left\{ B\right\} $ is a non empty family of fields. Every $B\in\left\{ B\right\} $ real pseudovector valued function on  $\Phi\times M^{3}\times T$.<br>$B(\phi,x,t)$ represents the intensity of the magnetic component of $\phi$ at $x$,$t$.',NULL);
INSERT INTO attribute_desc VALUES(134,1,'en','Manifold Geometry','Manifold Geometry','Branch of differential geometry that studies topological spaces that locally resembles Euclidean space near each point.',NULL);
INSERT INTO attribute_desc VALUES(135,1,'en','Place','The place occupied by the body','For every $X\in\left\{ X\right\}$, every $b\in\beta$ and every $t\in T$, the map $X:b\rightarrow C$ is 1:1, onto and continuous.<br>For every $X\in\left\{ X\right\}$, every $b\in\beta$ and every $t\in T$ the image $C=X(b,t)$ of $b$ under $X$ is a compact set with a piecewise continuous boundary $\partial X(b,t)$.<br>For every $\sigma\in\Sigma$ and $t\in T$ there exists an $X\in\left\{ X\right\} $ such that the image $X(b,t)$ of $b$ under $X$ represents the place occupied by the body sigma represented by $b$.',NULL);
INSERT INTO attribute_desc VALUES(136,1,'en','Mass','$M$: Mass','A function from $\Sigma$ to the set $\mathbb{R^{+}}$ of non-negative reals.<br>The value of $M$ in $\sigma,\in\Sigma$ represents the mass (inertia) of $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(137,1,'en','Mass Additivity','Mass additivity','For every $\sigma\in\Sigma$, if $b\hat{=}\sigma$ and $C$ is the image of $b$ under $X$, then $M$ is a Continuous function of the volume (Lebesgue measure) $\mu(b,t)$ of $b$ at $t$.<br>b) For any two distinct $\sigma,\sigma''\in\Sigma$, if $b\hat{=}\sigma$ and $b’\hat{=}\sigma’$, and $b\cup b''\hat{=}\sigma+\sigma''$, then $M(b\cup b'')=M(b)+M(b'')$.<br>c) If $b\hat{=}c$, then $M(b)$ represents the mass of $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(138,1,'en','Mass Conservation','Mass conservation','For every $\sigma\in\Sigma$, if $b\hat{=}\sigma$ and $C=X(b,t)$ and $C’ =X’(b)$ are two different configurations of $\sigma$ at a given time $t$, then the corresponding masses are the same: $M(\sigma)=\underset{X(b)}{\int}d^{3}x\varrho_{X}=\underset{X’(b)}{\int}d^{3}x\varrho_{X''}$.',NULL);
INSERT INTO attribute_desc VALUES(139,1,'en','Mass Density','Body density','Every $\varrho\in\left\{ \varrho\right\} $ is a bounded and continuous function from $\beta$ to the set of nonnegative reals.<br>If $b\hat{=}\sigma$, then $\varrho(b,x,t)$ represents the mass density of $\varrho$ at $x$,$t$.',NULL);
INSERT INTO attribute_desc VALUES(140,1,'en','Material Indifference','Material Indifference','Or objectivity. The constitutive equations must be invariant under coordinate transformations.',NULL);
INSERT INTO attribute_desc VALUES(141,1,'en','Mathematical Statistics','Mathematical Statistics','The application of probability theory to statistics.',NULL);
INSERT INTO attribute_desc VALUES(142,1,'en','Maxwell’s Eq','Maxwell’s equations','At any point $x\in M^{3}$ and any instant $t\in T$, for every field $phi\in \Phi$ and every charged body $\sigma\in \Sigma$, there exists a $k\in K$ such that<br>$\nabla\times E=-\frac{1}{c}\frac{\partial B}{\partial t}$, $\nabla\cdot B=0$<br>$\nabla\times B=-\frac{1}{c}\frac{\partial E}{\partial t}+\frac{4\pi}{c}j$, $\nabla\cdot E=4\pi\varrho$.',NULL);
INSERT INTO attribute_desc VALUES(143,2,'en','Metric Affine Connection','$\Gamma*$: Metric-affine connection','A connection for Metric-affine spaces where non-metricity and torsion are not zero.',NULL);
INSERT INTO attribute_desc VALUES(144,2,'en','Metric Connection','Metric connection','Also called Levi-Civita connection, it is dependent on the metric $g$. It gives us information about how to transport vectors along a curve, while conserving the metric.',NULL);
INSERT INTO attribute_desc VALUES(145,2,'en','Metric Tensor','$g_{\mu\nu}$: Metric tensor','A symmetric tensor field of type $(0,2)$ and signature $<1,3>$. Provides a sense of distance and angles between vectors telling us about shortest curve.',NULL);
INSERT INTO attribute_desc VALUES(145,1,'en','Metric Tensor','$g_{\mu\nu}$: Metric tensor','$\left\{ g\right\} $ is a nonempty family of symmetric tensor fields, of valence (0,2), on $M^{4}$.<br>The components of $g$ and their first and second derivatives w.r.t. the $x^{\mu}$ are real valued and bounded in every $V\subset M^{4}$ with the possible exception of a proper subset of $V$.<br>$M^{4}$ is endowed with a metric $ds^{2}=g_{\mu\nu}dx^{\mu}dx^{\nu}$ with $\mu,\nu=0,1,2,3$.',NULL);
INSERT INTO attribute_desc VALUES(146,1,'en','Moment of Momentum','Law of moment of momentum','For every $\sigma\in\Sigma$, every $t\in T$,every $\varrho\in\left\{ \varrho\right\} $, every $f_{b}\in\left\{ f_{b}\right\} $, and every $\mathrm{T\in\left\{ \mathrm{T}\right\} }$, there exists a $k\in K$ such that $\dot{L}=N$.',NULL);
INSERT INTO attribute_desc VALUES(147,2,'en','N','Dimension: $N=4$','The dimension of a manifold is the cardinality of the n-tuples of real numbers that represent points in the manifold.',NULL);
INSERT INTO attribute_desc VALUES(148,2,'en','Newton-Cartan Connection','$\nabla$: Newton-Cartan connection','Non-flat covariant connection. In Friedman it is found as $D$.',NULL);
INSERT INTO attribute_desc VALUES(149,1,'en','Non Gravitational Fields','Physical entities other than gravitational fields','$\overline{\Sigma}$ is a nonempty set disjoint from sigma.<br>Every $\overline{\Sigma}$ represents a physical system other than  a gravitation field.',NULL);
INSERT INTO attribute_desc VALUES(150,2,'en','Non Metricity','Non metricity tensor','It measures the failure of the connection to covariantly conserve the metric.',NULL);
INSERT INTO attribute_desc VALUES(151,2,'en','Non Metricity = 0','Non metricity tensor vanishes','Homogeneous Trautman condition.',NULL);
INSERT INTO attribute_desc VALUES(153,2,'en','Non-Local','Non-locality','Matter is a function of density. Nonlocality enters through quantum corrections to the effective field equations from loops of massless gravitons. These induce no macroscopic nonlocality in flat space background because their interactions are suppressed by derivatives.',NULL);
INSERT INTO attribute_desc VALUES(154,2,'en','Not-Definite-Positive','Class of signature','The class of signature for the metric tensor is not-definite-positive ej: $<-,+,+,+>$ or $<+,-,-,->$.',NULL);
INSERT INTO attribute_desc VALUES(155,1,'en','Event','Events and trayectory of motion','For every $\sigma\in\Sigma$, and every $k\in K$, every $X\in\left\{ X\right\} $ is a continuous and real valued function from $T$ to $E^{3}$.<br>For every $\sigma\in\Sigma$ and every  $k\in K$, $\dot{X}$ is a piece-wise continuous and real valued function from $T$ to $E^{3}$.<br>$X(\sigma,k,t)$ represents the position of $\sigma$, relative to the frame $k$ at the instant $t$.<br>Every quintuple $\left\langle \sigma,X_{1},X_{2},X_{3},t\right\rangle $ represents an event.<br>For any given $\sigma\in\Sigma $ and any given $k\in K$, the set $\left\{ X(\sigma,k,t)\mid t\in T\right\} $represents a trajectory (motion) of $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(156,1,'en','Identification','Identification','For any two $\sigma,\sigma''\in\Sigma$ and every $k\in K$ and every $t’\in T$, if $X\left(\sigma,t,k\right)=X\left(\sigma'',t,k\right)$ and $\dot{X}\left(\sigma,t,k\right)=\dot{X}\left(\sigma'',t,k\right)$, then $\sigma=\sigma’$.<br>The position and velocity values uniquely identify (characterize) a particle. Coordinates alone are insufficient for this: thus two different particles may be at the same place at the instant of collision but then they will have different (vector) velocities.',NULL);
INSERT INTO attribute_desc VALUES(157,1,'en','Additivity','Mass additivity','The mass of a system of point particles equals the sum of the partial masses. <br>If $\sigma_{i}\in\Sigma$ for every finite $i\in N$, then $M\left(\underset{i}{\dot{\sum}}\sigma_{i}\right)=\underset{i}{\sum}M(\sigma_{i})$.',NULL);
INSERT INTO attribute_desc VALUES(158,1,'en','Particles','Point particles','$\Sigma$ is a nonempty denumerable set.<br>Every $\Sigma$ is a particle.',NULL);
INSERT INTO attribute_desc VALUES(159,1,'en','Phase Space','Phase space','A set of coordinates, where each coordinate corresponds to a degree of freedom of the system, and each point in phase space represents a unique state of the system at a particular instant in time. ',NULL);
INSERT INTO attribute_desc VALUES(160,2,'en','Phi','$\phi$: Dynamical scalar field','Rest masses of elementary particles are allowed to vary in spacetime via a dynamical scalar field $\phi$.',NULL);
INSERT INTO attribute_desc VALUES(161,2,'en','Phi0','$\phi_{0}$: Cosmological matching parameter','For chosen values for $r$ and $q$, the present values of $w$ and $\Lambda$ are determined by the asymptotic value $\phi_{0}$, which in turn is found through a cosmological solution using the theory. ',NULL);
INSERT INTO attribute_desc VALUES(162,1,'en','Physical Euclidean Geometry','Physical Euclidean Geometry','Euclidean geometry with a physical interpretation. It holds reasonably well for small regions of space.',NULL);
INSERT INTO attribute_desc VALUES(163,1,'en','Physical Geometry','Physical Geometry','A geometrical theory gives different physical meanings to the primitives of the abstract theory D of metric spaces.',NULL);
INSERT INTO attribute_desc VALUES(164,1,'en','Physical Probability Theory','Physical Probability Theory','Theory of mathematical probability plus a physical interpretation of its primitives U and P.',NULL);
INSERT INTO attribute_desc VALUES(165,1,'en','Physical Coordinates','Physical coordinates','These identify physical things and are relative to some physical frame, and should not be confused with the geometrical coordinate system.',NULL);
INSERT INTO attribute_desc VALUES(166,1,'en','Physical Systems','Physical system','$\Sigma\neq\emptyset$.<br>Every $\sigma\subset\Sigma$ represents a physical system (material or not).',NULL);
INSERT INTO attribute_desc VALUES(167,1,'en','Poissonian','Poissonian','$P$ is a tensor field in phase space that talks about the physical system.',NULL);
INSERT INTO attribute_desc VALUES(168,2,'en','Poisson Eq 1','Poisson’s Eq','Poisson''s field equation relates the gravitational potential $\Phi$ with the mass density $\rho$, where $del(\Phi)$ is the divergence of the gradient of $\Phi$, and k is the newtonian gravitational constant.',NULL);
INSERT INTO attribute_desc VALUES(169,2,'en','Poisson Eq 2','Poisson’s Eq in curved space','Poisson''s field equation in curved space relates the Ricci tensor of the connection with the mass density.',NULL);
INSERT INTO attribute_desc VALUES(170,1,'en','Persistence','Once a particle always a particle.','For any two different $t$, $t''\in T$, or $\sigma\in\Sigma$ at $t$, then $\sigma\subset\Sigma$ at $t’$.<br>This postulate is needed in order to warrant that predictions and retrodictions calculated for a $Sigma$ on laws of motion and initial conditions will still refer to $Sigma$.',NULL);
INSERT INTO attribute_desc VALUES(171,1,'en','Probability Theory','Probability Theory','Branch of mathematics concerned with probability as a rigorous mathematical concept expressed in a set of axioms.',NULL);
INSERT INTO attribute_desc VALUES(172,2,'en','Psi','$\psi$: Matter fields','$\psi$ represents a collective symbol for various fields or matter degrees of freedom. These fields could represent different types of matter or physical quantities, such as scalar fields, vector fields, or spinor fields, depending on the specific theory. They describe the properties of the physical matter or fields that interact with the gravitational field represented by the metric.',NULL);
INSERT INTO attribute_desc VALUES(173,2,'en','R = 0','$R=0$','The Ricci scalar is zero.',NULL);
INSERT INTO attribute_desc VALUES(174,2,'en','R = Const','$R=Const.$','The Ricci scalar is constant.',NULL);
INSERT INTO attribute_desc VALUES(176,2,'en','R*','$\Re$: Affine Ricci scalar','The affine Ricci scalar is the trace of the Ricci tensor with respect to the metric and the affine connection, where the Ricci tensor is defined as: $\Re_{\mu\nu}:=\Gamma_{\mu\nu,\lambda}^{*\lambda}-\Gamma_{\mu\lambda,\nu}^{*\lambda}+\Gamma_{\mu\nu}^{*\rho}\Gamma_{\rho\lambda}^{*\lambda}-\Gamma_{\mu\lambda}^{*\rho}\Gamma_{\nu\rho}^{*\lambda}$.',NULL);
INSERT INTO attribute_desc VALUES(177,1,'en','Reference Frame','Reference frame','$K$ is a nonempty denumerable set.<br>Every $k$ is a rigid system of corpuscles at least four of which lie on the vertices of a regular trihedral.<br>For every $k$ there exists a Cartesian system of axes $e=\left\langle e_{1},e_{2}.e_{3}\right\rangle $ such that $e\hat{=}k$.<br>No $k$ interacts with any $\sigma\subset\Sigma$ that is not a part of $k$.<br>The configuration of every $k\in K$ is time-independent.',NULL);
INSERT INTO attribute_desc VALUES(178,2,'en','Ricci Scalar','$R$: Ricci scalar','The Ricci scalar is the trace of the Ricci tensor with respect to the metric and gives a measure of the curvature of space.',NULL);
INSERT INTO attribute_desc VALUES(179,2,'en','SM1','Matter action','The action of matter, $S_{M}$, quantifies the dynamics and interactions of matter. It is functional, meaning that it maps a set of fields (in this case, $g_{\mu\nu}$ and $\psi)$ to a real number, typically representing a Lagrangian action or density.',NULL);
INSERT INTO attribute_desc VALUES(180,2,'en','SM2','Affine matter action','The matter action, $S_{M}$, quantifies the behavior of matter fields $\psi)$, their interactions with the metric $(g_{\mu\nu}$, and their coupling to connection coefficients affines $\Gamma_{\mu\nu}^{\lambda}$.',NULL);
INSERT INTO attribute_desc VALUES(181,1,'en','Semantics','Semantics','The systematic study of meaning in language, formal logic and semiotics.',NULL);
INSERT INTO attribute_desc VALUES(182,1,'en','Set Theory','Set Theory','Theory of collections of mathematical objects.',NULL);
INSERT INTO attribute_desc VALUES(184,1,'en','Space-Time Contiguity','Space-time contiguity','Only field regions connectible by a field disturbance (hence separated by a timelike interval) can interact.',NULL);
INSERT INTO attribute_desc VALUES(185,1,'en','System of Particles','System of particles','A collection of individual particles that interact with each other in some way.',NULL);
INSERT INTO attribute_desc VALUES(186,2,'en','Tmn','$T_{\mu\nu}$: Stress-Energy-Momentum tensor','A $(2,0)$ symmetric tensor field representing the energy-momentum of the mass distribution, with specific energy density contributions from interactions dictated by theories.',NULL);
INSERT INTO attribute_desc VALUES(187,2,'en','T = 0','Dust','Energy momentum tensor is almost zero; models for dust.',NULL);
INSERT INTO attribute_desc VALUES(188,1,'en','Theory of Riemannian Spaces','Theory of Riemannian Spaces','Branch of differential geometry that studies smooth manifolds with a Riemannian metric.',NULL);
INSERT INTO attribute_desc VALUES(189,1,'en','Theory of Universal Time','Theory of Universal Time','A theory that assumes a single relational time for every place and every reference frame.',NULL);
INSERT INTO attribute_desc VALUES(190,1,'en','Theory of Local Time','Theory of local time','A theory of time relational to different inertial frames.',NULL);
INSERT INTO attribute_desc VALUES(191,1,'en','Time','Time','$T$ is an interval of real line.<br>Every $t$ represents an instant of time.<br>The relation $\leq$ that orders $T$ means “earlier than or simultaneous with.”',NULL);
INSERT INTO attribute_desc VALUES(192,1,'en','Time Range','tR:  The range of the local time function','$T$ is an interval of the real line.<br>$T$ is the range of the time function satisfying the axioms of the local time theory.<br>Every $t\subset T$ represents an instant of t-time.',NULL);
INSERT INTO attribute_desc VALUES(193,1,'en','Topology','Topology','The study of properties of geometric objects that are preserved under continuous deformations, such as stretching, twisting, crumpling and bending, but not tearing or gluing.',NULL);
INSERT INTO attribute_desc VALUES(194,2,'en','Torsion','Cartan torsion tensor','The anti-symmetric part of the connection.',NULL);
INSERT INTO attribute_desc VALUES(195,2,'en','Torsion = 0','Torsion = 0','Cartan''s torsion tensor vanishes. Homogeneous Trautman Condition $\widetilde{R}_{bd}^{ac}=\widetilde{R}_{db}^{ca}$.',NULL);
INSERT INTO attribute_desc VALUES(197,1,'en','Uniform Convergence','Uniform convergence','All series whose terms represent physical objects shall be uniformly convergent on the given interval.',NULL);
INSERT INTO attribute_desc VALUES(198,2,'en','V','$V$: Tangent vector field','To describe absolute space we introduce a tangent vector field $V$ The curves $\sigma$ that fit $V-T_{\sigma}=V$ along $\sigma$ are the lines of rigging.',NULL);
INSERT INTO attribute_desc VALUES(199,1,'en','Vector Spaces Theory','Vector Spaces Theory','Theory of the addition and multiplication of vector spaces.',NULL);
INSERT INTO attribute_desc VALUES(200,1,'en','Velocity and Acceleration','Velocity and acceleration','The derivatives $\dot{X}$ and $\ddot{X}$ exist and are bounded for every $X\in\left\{ X\right\} $, every $\beta\in b$, every $k\in K$ and every $t\in T$.<br>If $\beta\hat{=}\pi$ and $\pi\dot{\in}\sigma$, then $\dot{X}(\beta,k,t)$ and $\ddot{X}(\beta,k,t)$ represent the velocity and the acceleration respectively of the particle $\pi$ in the body $\sigma$ relative to the frame at time $t$.',NULL);
INSERT INTO attribute_desc VALUES(201,2,'en','Weyl Vector','Weyl vector','The Weyl vector is the trace of the non-metricity tensor with respect to its last two (symmetric) indices.',NULL);
INSERT INTO attribute_desc VALUES(202,2,'en','Weyl Vector = 0','Weyl vector vanishes',NULL,NULL);
INSERT INTO attribute_desc VALUES(203,2,'en','Xi','Mendoza’s tensor','Where $L_{M}^{2}$ defines a length fixed by the parameters of the theory: $L_{M}:=\zeta(\frac{GM}{a_{0}^{3}})^{\frac{1}{4}}$.',NULL);
INSERT INTO attribute_desc VALUES(204,2,'en','a, b, c, d','$a$, $b$, $c$, $d$','Cosmological matching parameters.',NULL);
INSERT INTO attribute_desc VALUES(205,2,'en','a, f, k','Arbitrary parameters',NULL,NULL);
INSERT INTO attribute_desc VALUES(206,2,'en','a0','Milgrom’s constant','Acceleration scale. Sistems experiencing accelerations lower than $a_{0}$ will present not standard dynamics.',NULL);
INSERT INTO attribute_desc VALUES(207,1,'en','c','c','A constant that represents the magnitude of the speed of electromagnetic signals in vacuum. It is a positive real number such that $\left[c\right]=LT^{-1}$.<br>Every $s\in S$ propagates in vacuum, relative to any $i\in I$, with uniform rectilinear motion at the speed $c$.',NULL);
INSERT INTO attribute_desc VALUES(208,2,'en','c0, c1','$C_{0}$, $C_{1}$: Cosmological matching parameters','In the universe rest frame, g has the asymptotic form $diag(-c_{0},c_{1},c_{1},c_{1})$, where $c_{0}$ and $c_{1}$  may vary on a Hubble timescale. ',NULL);
INSERT INTO attribute_desc VALUES(209,2,'en','dt','$dt$: Time function','Co-vector that induces a foliation of $M$ into three-dimensional hyper surfaces.',NULL);
INSERT INTO attribute_desc VALUES(210,2,'en','dt(V) = 1','Requirement for Timelike Curves','This condition is introduced to ensure that the curves $\sigma$ are timelike. The quantity $dt(V)$ represents the rate of change of time along the curves as experienced by an observer moving along V. Requiring $dt(V)=1$ ensures that the curves are moving forward in time according to the standard absolute time.',NULL);
INSERT INTO attribute_desc VALUES(211,2,'en','e','$e$: Arbitrary function',NULL,NULL);
INSERT INTO attribute_desc VALUES(212,2,'en','e = 0','$\epsilon=0$',NULL,NULL);
INSERT INTO attribute_desc VALUES(213,2,'en','e = 1','$\epsilon=1$',NULL,NULL);
INSERT INTO attribute_desc VALUES(214,2,'en','epsilon','$\epsilon$','Arbitrary parameter.','este atributo pertenece a general');
INSERT INTO attribute_desc VALUES(215,2,'en','eta','$\eta$: Minkowski’s metric','Flat non-dynamical metric. Since $Riem(\Gamma)=0$, we can always choose global coordinates in which $\eta_{\mu\nu}=diag(-1,1,1,1)$.',NULL);
INSERT INTO attribute_desc VALUES(216,2,'en','f(R) = R','$f(R)=R$','The function dependent on the Ricci scalar is of first order.',NULL);
INSERT INTO attribute_desc VALUES(217,2,'en','f(R) ≠ R','$f(R)≠R$','The function dependent on the Ricci scalar is of high order.',NULL);
INSERT INTO attribute_desc VALUES(218,2,'en','f(R*) = R*','$f(\Re)=\Re$','The function of the affine curvature scalar is of first order',NULL);
INSERT INTO attribute_desc VALUES(219,2,'en','f(R*) ≠ R*','$f(\Re)≠\Re$','The function of the affine curvature scalar is of high order',NULL);
INSERT INTO attribute_desc VALUES(220,2,'en','f1(Phi), f2(Phi), f3(Phi)','Arbitrary functions','This functions help build algebraically the metric tensor and the action.',NULL);
INSERT INTO attribute_desc VALUES(221,2,'en','f’(R) = 1','$f’(R)=1$','The first derivative of the function dependent on the Ricci scalar is one.',NULL);
INSERT INTO attribute_desc VALUES(222,2,'en','f’(R*) = 1','$f’(\Re)=1$','The first derivative of the function dependent on the affine Ricci scalar is one.',NULL);
INSERT INTO attribute_desc VALUES(223,2,'en','f’’(R) = 0','$f’’(R)=0$','The second derivative of the function of the Ricci scalar is zero.',NULL);
INSERT INTO attribute_desc VALUES(224,2,'en','f’’(R) ≠ 0','$f’’(R)≠0$','The second derivative of the function of the Ricci scalar is not zero.',NULL);
INSERT INTO attribute_desc VALUES(225,2,'en','f’’(R*) = 0','$f''''(\Re)=0$','The second derivative of the function of the affine curvature scalar is zero.',NULL);
INSERT INTO attribute_desc VALUES(226,2,'en','f’’(R*) ≠ 0','$f''''(\Re)≠0$','The second derivative of the function of the affine curvature scalar is not zero.',NULL);
INSERT INTO attribute_desc VALUES(227,2,'en','h','$h$: Flat Metric tensor','A symmetric tensor field of type $(2,0)$. h is defined on de cotangent space $T_{p}^{*}\times T_{p}^{*}$ and has signature $<3,0,1>$. It induces a three-dimensional metric on each hypersurface.',NULL);
INSERT INTO attribute_desc VALUES(228,2,'en','h(dt,w) = 0','Temporal orthogonality','An orthogonality condition that describes euclidean geometry.',NULL);
INSERT INTO attribute_desc VALUES(230,2,'en','k1 = c3/16piG','Coupling constant',NULL,NULL);
INSERT INTO attribute_desc VALUES(231,2,'en','c','$c$: Light speed','The invariance of the velocity of electromagnetic signals. Light has the same constant velocity in all inertial reference frames.',NULL);
INSERT INTO attribute_desc VALUES(232,1,'en','kappa','$\kappa$ Einstein’s constant','$\kappa$ is a positive real number with dimension $L^{-1}M^{-1}T^{2}$.<br>$\kappa$ represents the coupling of $\sigma$ with $\bar{\sigma}$.',NULL);
INSERT INTO attribute_desc VALUES(233,2,'en','n = -2w','$\eta = -2w$',NULL,NULL);
INSERT INTO attribute_desc VALUES(234,2,'en','n = 0','$\eta = 0$',NULL,NULL);
INSERT INTO attribute_desc VALUES(235,2,'en','n0','$n$','Arbitrary parameter. Sometimes found as $\eta$.','n0 no está en Will, tal vez sea eta, mejor quitarlo.');
INSERT INTO attribute_desc VALUES(236,2,'en','r, q','$r$, $q$','Arbitrary parameters.',NULL);
INSERT INTO attribute_desc VALUES(237,2,'en','t','$t$: Cosmic time function','A nondynamical scalar field. The gradient of $t$ is covariantly constant and timelike with respect to $\eta$. This scalar field selects out preferred spatial sections of “strata” in the universe that are orthogonal to $\nabla$$t$.',NULL);
INSERT INTO attribute_desc VALUES(238,2,'en','tau','$\tau$','Arbitrary parameter. This represents a constraint on the gauge of the vector field $k_{\mu}$ imposed by the lack of full gauge invariance of the action $I$.','tau está en general');
INSERT INTO attribute_desc VALUES(239,2,'en','tau = 0','$\tau=0$','In this case, no constraint is placed on the vector field.',NULL);
INSERT INTO attribute_desc VALUES(240,2,'en','tau = 1','$\tau=1$','This represents a constraint on the gauge of the vector field $k_{\mu}$ imposed by the lack of full gauge invariance of the action $I$.',NULL);
INSERT INTO attribute_desc VALUES(241,2,'en','w','$w(\phi)$: Arbitrary coupling function',NULL,NULL);
INSERT INTO attribute_desc VALUES(242,2,'en','w = 0','$w=0$','The coupling function $w(\phi)$ is zero.',NULL);
INSERT INTO attribute_desc VALUES(243,2,'en','w-inf','$w\rightarrow\infty$','In this limit the Brans-Dicke theory reduces to general relativity.',NULL);
INSERT INTO attribute_desc VALUES(244,2,'en','w0, w1','$w_{0}, w_{1}$','Cosmological matching parameters',NULL);
INSERT INTO attribute_desc VALUES(245,2,'en','w’ = 0','$w’=0$',NULL,NULL);
INSERT INTO attribute_desc VALUES(246,1,'en','{XGR}','{XGR}: Position of a point system','For every $i=1,2,3$, $\left\{ X_{i}\right\} $ is a nonempty family of functions.<br>Every $X_{i}\in\left\{ X_{i}\right\} $ is a function from $\overline{\Sigma}\times K\times T$ to $\mathbb{R}$, continuous w.r.t. $t$.<br>$X(\bar{\sigma},k,t)$ represents the position of a point system $\bar{\sigma}\in\bar{\Sigma}$, referred to $k$, at the instant $t$ relative to $k$.',NULL);
INSERT INTO attribute_desc VALUES(247,1,'en','{XR}','Position of a system','$\left\{ X\right\} $ is a nonempty family of functions.<br>Every $X\in\left\{ X\right\} $ is a function from $\Sigma\times I\times T$ to $R^{3}$.<br>$X\left(\sigma,i,t\right)$ represents the position of a point system $\sigma\subset\Sigma$, referred to the frame $\tau$, at the instant $t$ relative to $\tau$.<br>For every point event there exists a septuple $\left\langle \sigma,s,\tau,X_{0},X_{1},X_{2},X_{3}\right\rangle \hat{=}$ event.',NULL);
INSERT INTO attribute_desc VALUES(248,1,'en','{X}','Position of a particle','$X$ is continuous and bounded for every $\beta$, $k$, and $t$.<br>$X(\beta,k,t)$ represents the place (location) of the particle $\pi$ of the body $\sigma$, relative to the frame $k$ at the instant $t$.',NULL);
INSERT INTO attribute_desc VALUES(249,2,'en','Φ','$\Phi$: Gravitational potential','Potential produced by a space-type vector field that represents the gravitational field.',NULL);
INSERT INTO attribute_desc VALUES(250,1,'en','Tensor Degeneration','Tensor degeneration','When the constitutive tensor degenerates into $(\epsilon,\mu^{-1})$, the field equations become $\nabla\times E=-\frac{1}{c}\frac{\partial B}{\partial t}$, $\nabla\cdot B=0$,<br>$\nabla\times H=-\frac{1}{c}\frac{\partial D}{\partial t}+\frac{4\pi}{c}j$, $\nabla\cdot D=4\pi\rho$.',NULL);
INSERT INTO attribute_desc VALUES(1,2,'es','(dt ⊗ K) = 0','Constricción en la geometría temporal','Esta ecuación de campo impone restricciones a la geometría temporal, especificando que no es afectada por el tensor de curvatura de Riemann ($K$ en Friedman).',NULL);
INSERT INTO attribute_desc VALUES(2,1,'es','1/r','Inverso de la distancia','Postulado desde una observación empírica: $E$ y $B$ caen con una distancia al menos tan rápida como $\frac{1}{r}$. ',NULL);
INSERT INTO attribute_desc VALUES(3,2,'es','<1,3>','Signatura del tensor métrico','Podemos tener $g_{ij}=diag(1,-1,-1,-1)$ en cualquier punto dado $p\in M$ (pero no necesariamente en una vecindad finita de $p$) siempre que $g$ tenga signatura $\left\langle 1,3\right\rangle $. Una variedad pseudo-riemanniana cuya métrica $g$ tenga esta signatura será una variedad lorentziana (por lo tanto, el espacio-tiempo de Minkowski es simplemente una variedad lorentziana plana).',NULL);
INSERT INTO attribute_desc VALUES(3,1,'es','<1,3>','Signatura','$g_{00}>0$ y $g_{ij}<0$ $(i,j, =1,2,3)$ en todas partes.<br>$g_{ij}-(g_{0i}g_{0j}/g_{00})<0$ en todas partes.<br>Para asegurar que $x^{0}$, o más bien $(g_{00})^{\frac{1}{2}}x^{0}/c$,<br>sea una coordenada de tiempo y los otros serán coordenadas espaciales según lo requerido por GR 2.3.',NULL);
INSERT INTO attribute_desc VALUES(4,2,'es','<3,0,1>','Signatura del tensor plano h','$h_{p}$ tiene una matriz de componentes 4x4 ($h^{ij}$) en cada sistema de coordenadas $\left\langle x_{i}\right\rangle $, y siempre podemos encontrar el sistema en el cual ($ h^{ij}$) está diagonalizado con todos los elementos diagonales iguales a +1, -1 o cero. La tripleta $\left\langle n_{+} n_{-},n_{0}\right\rangle $ donde $n_{0}$ es el número de elementos diagonales que desaparecen, es la signatura de $h_{p}$.',NULL);
INSERT INTO attribute_desc VALUES(5,1,'es','Acción','Principio de acción','Se trata de una declaración de la forma $\partial S=0$ donde $\partial S$ designa la primera variación de un funcional $S$ de un conjunto de variables físicas $q,q'',q''''$, … refiriéndose a un sistema físico, donde $S$ es una integral definida, $\partial q=0$ en los límites de integración y $\partial S=0$ implica leyes físicas, digamos ecuaciones de movimiento o ecuaciones de campo.',NULL);
INSERT INTO attribute_desc VALUES(6,2,'es','Conexión Afín','$\Gamma$: Conexión afín','En ausencia de un campo tensor métrico, una conexión generalizada para campos vectoriales se descompone en componentes irreducibles, donde el campo $B$ es la parte sin rastro de la torsión, $A_{\mu}$ es la traza de la torsión y $\hat{ \Gamma}_{\left(\mu\nu\right)}^{\lambda}=\Gamma_{\mu\nu}^{\lambda}$ es el nuevo nombre de la parte simétrica de la conexión afín.',NULL);
INSERT INTO attribute_desc VALUES(6,1,'es','Conexión Afín','Conexión afín','Por cada $\sigma\in \Sigma$ existe un tensor métrico $g$ cuya afinidad métrica asociada $\Gamma$ representa la fuerza de $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(7,1,'es','Álgebra','Álgebra','El estudio de los símbolos matemáticos y variables, y las reglas para manipular fórmulas.',NULL);
INSERT INTO attribute_desc VALUES(8,1,'es','Análisis','Análisis','La rama de las matemáticas que se ocupa de los límites y las teorías relacionadas, como la diferenciación, la integración, la medida, las series infinitas y las funciones analíticas.',NULL);
INSERT INTO attribute_desc VALUES(9,1,'es','Geometría Analítica','Geometría Analítica','El estudio de la geometría utilizando un sistema de coordenadas.',NULL);
INSERT INTO attribute_desc VALUES(10,1,'es','Dinámica Analítica','Dinámica Analítica','Una clase de teorías parcialmente interpretadas que describen la evolución de los sistemas físicos.',NULL);
INSERT INTO attribute_desc VALUES(11,1,'es','Antecedencia','Antecedencia','Si $A$ y $B$ son propiedades dependientes del tiempo y $A$ determina $B$ (ya sea de forma causal o estocástica), entonces $B$ en el momento $t$ es un funcional de $A$ en todo momento$t’$ antes y hasta $t$.',NULL);
INSERT INTO attribute_desc VALUES(12,1,'es','Fuerza Aplicada','Fuerza Aplicada','Cada $F^{e}\in\left\{ F^{e}\right\}$ es un vector real evaluado en $\Sigma\times K\times E^{3}\times T$.<br>El valor de $F^{e}$ en una sextupla dada $\left\langle \sigma,k,x,t\right\rangle $ representa la fuerza externa actuando sobre $\sigma$, relativa al marco $k$, en el lugar $x$ y en el instante $t$.',NULL);
INSERT INTO attribute_desc VALUES(13,1,'es','Forma Asintótica','Forma asintótica','Los componentes de $g$ se aproximan a valores constantes a medida que $x^{i}(i=1,2,3)$ tienden a infinito.<br>El tensor métrico, que resuelve las ecuaciones de campo, debe representar un sistema aislado. Fuera de cada $V\subset M^{4}$, las formas asintóticas de las componentes de $g$ son las de las ondas esféricas salientes.',NULL);
INSERT INTO attribute_desc VALUES(14,2,'es','B','$B$: Campo tensorial simétrico','El campo tensorial simétrico $B$ normalmente se asocia con la presencia de múltiples métricas, que describen cómo se miden las distancias y los intervalos de diferentes maneras. En las teorías estratificadas y bimétricas puede haber dos o más métricas para describir diferentes aspectos de la gravedad o el espacio-tiempo, como las variaciones en la fuerza o el alcance de la gravedad. $B$ ayuda a relacionar y conciliar estas métricas, asegurando que la teoría siga siendo autoconsistente.',NULL);
INSERT INTO attribute_desc VALUES(15,1,'es','Balance del Momentum','Ley del balance del momentum','Por cada $\sigma\in\Sigma$, $t\in T$, cada $\rho\in\left\{ \rho\right\} $, cada $f_{b}\in\left\{ f_{ b}\right\} $ y cada $\mathrm{T\in\left\{ \mathrm{T}\right\} }$, existe un $k\in K$ tal que $\dot{p}= F $.',NULL);
INSERT INTO attribute_desc VALUES(16,1,'es','Cuerpos','Cuerpos','$\Sigma$ es un conjunto numenable no vacío.<br>Cada $\Sigma$ es un cuerpo.',NULL);
INSERT INTO attribute_desc VALUES(17,1,'es','Densidad de Fuerza','Densidad de fuerza','Cada $f_{b}\in\left\{ f_{b}\right\} $ es un campo vectorial real y acotado sobre $\beta\times K\times E^{3}\times T$.<br>Si $b\hat{=}\sigma$, entonces $f_{b}(b,k,x,t)$ representa la fuerza por unidad de volumen sobre el cuerpo $\sigma.$',NULL);
INSERT INTO attribute_desc VALUES(18,1,'es','Estrés','Estrés del cuerpo','Cada $\mathrm{T\in\left\{ \mathrm{T}\right\} }$ es un campo tensorial real y acotado de valencia (2,0) sobre $\beta\times K\times E^{3 }\times T$.<br>Si $b\hat{=}\sigma$ y $beta\hat{=}\pi$, entonces $\mathrm{T(\beta,K,x,t)}$ representa la tensión del cuerpo en la partícula $ \pi\dot{\in}\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(19,1,'es','Equivalencia','Clase de equivalencia de representaciones','Sea $X''=a+QX$, con funciones de tiempo $a$ y $Q$, que representan un cambio de marco. Si $V$ es un vector que se refiere a $\pi\dot{\in}\sigma\in\Sigma$, que al cambiar de marco se convierte en $V''=QV$, entonces $V''$ y $V$ se refieren a la misma situación física.<br>Si $S$ es un tensor de segundo rango que se refiere a $\pi\dot{\in}\sigma\in\Sigma$, que al cambiar de marco se convierte en $S''=QS\tilde{Q}$, donde $\tilde{Q}$ es la trasposición de $Q$, entonces $S''$ y $S$ se refieren a la misma situación física.',NULL);
INSERT INTO attribute_desc VALUES(20,1,'es','Densidad de Carga','Densidad de carga','$\left\{ \rho\right\} $ es una familia de funciones no vacía.<br>Cada $\rho$ es una función escalar de $\beta\times M^{3}\times T$ a $\mathbb{R}$<br>Si $b\hat{=}\sigma$, entonces $\rho(b,x,t)$ representa la densidad de carga de $\sigma$ en $x$,$t$.',NULL);
INSERT INTO attribute_desc VALUES(21,1,'es','Cuerpos Cargados','Cuerpos cargados','$\Sigma$ es un conjunto no vacío.<br>Cada $\Sigma$ es un cuerpo cargado.',NULL);
INSERT INTO attribute_desc VALUES(22,1,'es','{Beta*}','Variedad de cuerpos cargados','$\left\{ \beta\right\} $ es una familia no vacía de conjuntos de puntos.<br>Cada $b\in\beta$ es una variedad diferenciable tridimensional.<br>Por cada $\sigma\in\Sigma$ existe un $b\in\beta$ tal que $b\hat{=}\sigma$ puntualmente.',NULL);
INSERT INTO attribute_desc VALUES(23,1,'es','Espacio de Configuración','$Q$: Espacio de configuración','Un espacio matemático que representa todas las configuraciones o posiciones posibles de los grados de libertad de un sistema. Cada punto en el espacio de configuración corresponde a una disposición única de estos grados de libertad, que definen un estado específico del sistema.',NULL);
INSERT INTO attribute_desc VALUES(24,2,'es','Cte < 0','$cte<0$','El escalar de Ricci es constante y negativo en todos los puntos.',NULL);
INSERT INTO attribute_desc VALUES(25,2,'es','Cte > 0','$cte>0$','El escalar de Ricci es constante y positivo en todos los puntos.',NULL);
INSERT INTO attribute_desc VALUES(26,1,'es','Contigüidad','Contigüidad','Si $A$ y $B$ son propiedades dependientes del lugar y $A$ determina $B$ (ya sea causal o estocásticamente), entonces $B$ en el lugar $x$ es un funcional de $A$ en todos los lugares x’ que rodean $A$ x.',NULL);
INSERT INTO attribute_desc VALUES(27,1,'es','Transformaciones de Coordenadas','Transformación de coordenadas','Todas las transformaciones de coordenadas en $M^{4}$ son mapas biyectivos.<br>El jacobiano de cada transformación de coordenadas no desaparece en ninguna parte.<br>Las áreas y los volúmenes no deberían desvanecerse con las transformaciones de coordenadas, porque de lo contrario las cosas mismas parecerían desvanecerse por las operaciones de papel y lápiz.',NULL);
INSERT INTO attribute_desc VALUES(28,1,'es','Cotiempo','Cotiempo','Por cada $t$, $t''\in I$, los cotiempos asociados son tales que $\frac{\partial X_{0}}{\partial X''_{0}}$ existe y es positiva.',NULL);
INSERT INTO attribute_desc VALUES(29,2,'es','Curvatura','$Riem(\Gamma)$:  Tensor de curvatura de Riemann','El tensor de curvatura de una conexión afín es un campo tensorial con valor de transformación lineal que asigna un mapeo a cada par de vectores en $p.$',NULL);
INSERT INTO attribute_desc VALUES(30,2,'es','Curvatura = 0','Curvatura = 0','El tensor de curvatura de Riemann es cero en todo el espacio. En Will se le encuentra como $K=0$.',NULL);
INSERT INTO attribute_desc VALUES(31,2,'es','D(V) = 0','Constancia covariante de V','Que la derivada covariante de $V$ sea igual a cero hace que las líneas en el aparejo del espacio-tiempo sean geodésicas.',NULL);
INSERT INTO attribute_desc VALUES(32,2,'es','D(dt) = 0','Cortes de simultaneidad planos','La derivada covariante igual a cero asegura que los cortes de simultaneidad sean planos.',NULL);
INSERT INTO attribute_desc VALUES(33,2,'es','D(g) = 0','Constancia covariante de la métrica','La derivada covariante del tensor métrico se desvanece. Condición que preserva ángulos y distancias cuando se transporta de forma paralela un vector a lo largo de una curva.',NULL);
INSERT INTO attribute_desc VALUES(34,2,'es','D(h) = 0','Constancia de la métrica plana','La derivada covariante de h describe la geometría euclidiana.',NULL);
INSERT INTO attribute_desc VALUES(35,2,'es','Signatura Positiva','Clase de signatura','La signatura del tensor métrico es toda positiva $<+,+,+,+>$, propia de otros espacios matemáticos y no físicos.',NULL);
INSERT INTO attribute_desc VALUES(36,2,'es','Dependiente','Dependencia entre variables','La conexión  $\Gamma_{\mu\nu}^{\lambda}$ y el tensor métrico $g_{\mu\nu}$ dependen uno del otro.',NULL);
INSERT INTO attribute_desc VALUES(37,1,'es','Análisis Dimensional','Análisis Dimensional','El análisis que exhibe los géneros a los que pertenece un conjunto de magnitudes.',NULL);
INSERT INTO attribute_desc VALUES(38,1,'es','E3','$E^{3}$: Espacio físico euclideano','$E^{3}$ es un espacio euclideano 3-dimensional.<br>$E^{3}$ representa (mapea) el espacio ordinario.',NULL);
INSERT INTO attribute_desc VALUES(39,1,'es','E3R','$E^{3}R$: Espacio euclidiano relativo','$E^{3}$ es un espacio euclidiano tridimensional con producto interno.<br>$E^{3}$ representa el espacio ordinario relativo a (o visto desde) cualquier $i\subset I$ dado). La relatividad especial adopta un concepto clásico del espacio como un contenedor que "permanece siempre similar e inamovible" (Newton), pero lo restringe a cada marco.',NULL);
INSERT INTO attribute_desc VALUES(40,1,'es','Campos Electromagnéticos','Campos electromagnéticos','$\Phi$ es un conjunto no vacío.<br>Cada $\Phi$ es un campo electromagnético.',NULL);
INSERT INTO attribute_desc VALUES(41,1,'es','Señales Electromagnéticas','Señales electromagnéticas','$S\neq\emptyset l$ and $S\subset\Sigma$.<br>Cada $s\in S$ representa una señal electromagnética.',NULL);
INSERT INTO attribute_desc VALUES(42,2,'es','Ec. de Einstein','Ecuación de Einstein','Relaciona la curvatura del espacio-tiempo con la distribución de materia y energía. $\mathbf{Ric}$ es el tensor de Ricci, $R$ es el escalar de curvatura y $\mathbf{T}$ es el tensor de estrés-energía-momentum.',NULL);
INSERT INTO attribute_desc VALUES(42,1,'es','Ec. de Einstein','Ecuación de Einstein','Por cada $x\in V$, cada $\sigma\in\Sigma$, cada $\bar{\sigma}\in\bar{\Sigma}$ <br>y cada $\mathrm{\mathrm{T}\in\{T\}}$, existe un $g\in\{g\}$ tal que $G=\kappa\mathrm{T}$.',NULL);
INSERT INTO attribute_desc VALUES(43,1,'es','{E*}','Intensidad del campo eléctrico','$\left\{ E\right\} $ es una familia de campos no vacía.<br>Cada $E\in\left\{ E\right\} $ es una función real y vectorial de $\Phi\times M^{3}\times T$.<br>$E(\phi,x,t)$ representa la intensidad de la componente eléctrica de $\phi$ en $x$,$t$.',NULL);
INSERT INTO attribute_desc VALUES(44,1,'es','Tensor Energía-momentum','Tensor de Estrés-Energía-Momento','Una familia de campos tensoriales representando la totalidad del tensor de energía-momento-estrés (e.m. + mecánicos) de los miembros de $\bar{\sigma}$<br>$\mathrm{T}$ es un campo tensor simétrico contravariante en $V\subset M^{4}$.<br>$\mathrm{T}$ representa la energía, el impulso y la tensión de todos los sistemas $\bar{\sigma}\in\bar{\Sigma}$ en $V$.',NULL);
INSERT INTO attribute_desc VALUES(45,1,'es','Ec. 01','Segunda Ley de Newton','La segunda ley establece que la tasa de cambio del momento de un objeto es igual a la fuerza neta que actúa sobre él.',NULL);
INSERT INTO attribute_desc VALUES(46,1,'es','Ec. 02','Ecuaciones de Hamilton','Estas dos ecuaciones describen la dinámica de un sistema físico en términos de coordenadas generalizadas $q$ y sus momentos conjugados $p$. La primera describe cómo evolucionan las posiciones en respuesta a cambios en el impulso. La segunda describe cómo los momentos conjugados $p$ cambian en el tiempo. Afirma que la tasa de cambio del impulso (p) es igual a la derivada parcial negativa del hamiltoniano $H$ con respecto a la coordenada generalizada correspondiente $q$.',NULL);
INSERT INTO attribute_desc VALUES(47,1,'es','Ec. 03','Ecuación de Hamilton','Esta ecuación representa la tasa de cambio de una coordenada generalizada $\phi$ con el tiempo. Este cambio está determinado por el producto escalar de un vector de impulso generalizado $P$ y el gradiente (nabla, $\nabla$) de la función hamiltoniana $H$. Describe cómo evolucionan las coordenadas en respuesta a variaciones en el momento y la función de energía hamiltoniana.',NULL);
INSERT INTO attribute_desc VALUES(48,1,'es','Ec. 04','Ecuación de Hamilton- Jacobi','Esta ecuación expresa la conservación de la acción $S$ con respecto al tiempo $t$ en la teoría jacobiana. Afirma que la tasa de cambio de la acción con respecto al tiempo, representada por la derivada parcial $\frac{\partial S}{\partial t}$, es igual a menos el hamiltoniano (H) del sistema. En otras palabras, afirma que la acción total del sistema, cuando se combina con el hamiltoniano, permanece constante en el tiempo.',NULL);
INSERT INTO attribute_desc VALUES(49,1,'es','Ec. 05','Ecuación de Euler-Lagrange','Esta ecuación describe la dinámica de un sistema físico. Afirma que la derivada temporal de la derivada parcial de la función lagrangiana $L$ con respecto a la velocidad generalizada $q̇$ menos la derivada parcial de la función lagrangiana con respecto a la coordenada generalizada $q$ es igual a cero.',NULL);
INSERT INTO attribute_desc VALUES(50,2,'es','Ec. 13M','Ec. 13M','Ecuación de campo para la teoría extendida tipo MoND local F(R,T).',NULL);
INSERT INTO attribute_desc VALUES(51,2,'es','Ec. 13','Acción a la Palatini','La métrica y la conexión son independientes. No se varía sobre la conexión. Note que el nuevo tensor de Ricci es construido independientemente de la conexión: $\Re=g_{\mu\nu}R_{\mu\nu}$.',NULL);
INSERT INTO attribute_desc VALUES(52,2,'es','Ec. 14M','Ec. 14M','Ecuación de campo para la teoría extendida tipo MoND no-local con métrica pura.',NULL);
INSERT INTO attribute_desc VALUES(53,2,'es','Ec. 18','Ec. 18','Ecuación de campo a la Palatini 1.','Revisar nombre');
INSERT INTO attribute_desc VALUES(54,2,'es','Ec. 18M','Ec. 18M','Ecuación de movimiento de la teoría extendida tipo MoND no-local con métrica pura.','Revisar nombre');
INSERT INTO attribute_desc VALUES(55,2,'es','Ec. 19','Ec. 19','La ecuación de campo a la Palatini $\bar{\nabla}$ es la derivada covariante definida de forma independiente o mediante la conexión métrico-afín.','Revisar nombre');
INSERT INTO attribute_desc VALUES(56,2,'es','Ec. 2M','Ec. 2M','Ecuación de movimiento de la teoría extendida no-local a la Palatini tipo MoND.','Revisar nombre');
INSERT INTO attribute_desc VALUES(57,2,'es','Ec. 37','Ec. 37','Ecuación de movimiento de la teoría extendida F(R,T).','Revisar nombre');
INSERT INTO attribute_desc VALUES(58,2,'es','Ec. 34M, 35M','Ec. 34M, 35M','Ecuación de movimiento para la teoría extendida tipo MoND local con métrica pura.',NULL);
INSERT INTO attribute_desc VALUES(59,2,'es','Ec. 4M','Ec. 4M','Ecuación de campo de la teoría extendida local con métrica pura.',NULL);
INSERT INTO attribute_desc VALUES(60,2,'es','Ec. 46','Ec. 46','Ecuación de campo tras variar de manera independiente con respecto a la métrica.',NULL);
INSERT INTO attribute_desc VALUES(61,2,'es','Ec. 47','Ec. 47','Ecuación de campo tras variar de manera independiente con respecto a la conexión afín.',NULL);
INSERT INTO attribute_desc VALUES(62,2,'es','Ec. 48','Ec. 48','Ecuación de campo tras variar de manera independiente con respecto al multiplicador de Lagrange.',NULL);
INSERT INTO attribute_desc VALUES(63,2,'es','Ec. 5','Ec. 5','Acción total para la métrica $f(R)$.',NULL);
INSERT INTO attribute_desc VALUES(64,2,'es','Ec. 5-30','Ec. 5-30','Acción para las teorías escalares-tensoriales',NULL);
INSERT INTO attribute_desc VALUES(65,2,'es','Ec. 5-31','Ec. 5-31','Ecuaciones de campo',NULL);
INSERT INTO attribute_desc VALUES(66,2,'es','Ec. 5-45','Ec. 5-45','Acción para las teorías vectoriales-tensoriales',NULL);
INSERT INTO attribute_desc VALUES(67,2,'es','Ec. 5-47','Ec. 5-47','Ecuaciones de campo de las teorías vectoriales-tensoriales',NULL);
INSERT INTO attribute_desc VALUES(68,2,'es','Ec. 5-67','Ec. 5-67','Acción para la teoría bimétrica de Rosen',NULL);
INSERT INTO attribute_desc VALUES(69,2,'es','Ec. 5-68','Ec. 5-68','Ecuación de campo de la teoría de Rosen',NULL);
INSERT INTO attribute_desc VALUES(70,2,'es','Ec. 5-73','Ec. 5-73','Acción para la teoría bimétrica de Rastall',NULL);
INSERT INTO attribute_desc VALUES(71,2,'es','Ec. 5-75','Ec. 5-75','Ecuación de campo de la teoría de Rastall',NULL);
INSERT INTO attribute_desc VALUES(72,2,'es','Ec. 5-82','Ec. 5-82','Acción para las teorías bimétricas BSLL',NULL);
INSERT INTO attribute_desc VALUES(73,2,'es','Ec. 5-84','Ec. 5-84','Ecuación de campo de la teoría bimétrica de BSLL',NULL);
INSERT INTO attribute_desc VALUES(74,2,'es','Ec. 5-93','Ec. 5-93','Acción para las teorías estratificadas',NULL);
INSERT INTO attribute_desc VALUES(75,2,'es','Ec. 5-95','Ec. 5-95','Ecuación de campo de las teorías estratificadas',NULL);
INSERT INTO attribute_desc VALUES(76,2,'es','Ec. 6','Ec. 6','Ecuación de campo de la teoría $f(R)$ métrica',NULL);
INSERT INTO attribute_desc VALUES(77,2,'es','Ec. 8M','Ec. 8M','Ecuación de campo de la teoría extendida no local a la Palatini. Las variaciones nulas de la acción con respecto a la métrica producen esta ecuación de campo donde el tensor adimensional es $\chi_{\mu\nu}:=L_{M}^{2}R_{\mu\nu}$ y $f ''(\chi):=\frac{df(\chi)}{d\chi}$.',NULL);
INSERT INTO attribute_desc VALUES(78,2,'es','Ec. 9a','Ec. 9a','Si el escalar de Ricci es igual a cero: $R=0$ entonces la ecuación de campo se reduce a: $R_{\mu\eta}=0$.',NULL);
INSERT INTO attribute_desc VALUES(79,2,'es','Ec. 9b','Ec. 9b','Si el escalar de Ricci es constante: $R=cte$, entonces la ecuación de campo se reduce a: $R_{\mu\nu}=g_{\mu\nu}\frac{C}{4}$, y la solución simétrica máxima es el espacio de de Sitter ó el anti-de Sitter, dependiendo del signo de la constante.',NULL);
INSERT INTO attribute_desc VALUES(80,2,'es','Ec. 9c','Ec. 9c','Si el escalar de Ricci es constante: $R=cte$ entonces la ecuación de campo se reduce a: $R_{\mu\nu}=g_{\mu\nu}\frac{C}{4}$ y el la solución máximamente simétrica es de Sitter en el espacio anti-de Sitter, dependiendo del signo de la constante.',NULL);
INSERT INTO attribute_desc VALUES(81,1,'es','Equipresencia','Equipresencia','Un principio heurístico utilizado en teorías de materiales y termodinámica: “Una variable independiente presente en una ecuación constitutiva se encuentra presente en todas nuestras consideraciones”. (Dado que en esta red no se toman estas teorías como objetos, este atributo se encuentra en el nodo ínfimo).',NULL);
INSERT INTO attribute_desc VALUES(82,1,'es','Espacio Euclidiano','$E^{3}$: Espacio euclidiano','Espacio 3-dimensional que representa (mapea) el espacio ordinario.',NULL);
INSERT INTO attribute_desc VALUES(83,1,'es','Fuerza Externa','Fuerza externa','Cada $F^{e}\in\left\{ F^{e}\right\}$ es un vector de valor real en $\Sigma\times K\times E^{3}\times T$.<br>El valor de $F^{e}$ en cualquier 6-tupla $\left\langle \sigma,k,x,t\right\rangle $ representa la fuerza externa que actúa sobre $\sigma$, relativa al marco $k$, en el lugar $x$ y en el instante $t$.',NULL);
INSERT INTO attribute_desc VALUES(84,1,'es','F=ma','Leyes de Newton','Por cada $\sigma$, $\sigma''\in\Sigma$, cada $t\in T$, cada $F^{e}\in\left\{ F^{e}\right\}$ y cada $F ^{i}\in\left\{ F^{i}\right\}$, hay al menos un $k\in K$ tal que<br>$\dot{p}(\sigma,t,k)=F^{e}(\sigma,t,k)+\underset{\sigma''\neq\sigma}{\sum}F^{i}( \sigma,\sigma'',t,k)$<br>y<br>$F^{i}(\sigma,\sigma’,t,k)=-F^{i}(\sigma'',\sigma,t,k)$.',NULL);
INSERT INTO attribute_desc VALUES(85,2,'es','F(R*,Lm)','$F(\Re,L_{m})$','La acción es una función del escalar de Ricci afín y del Lagrangiano de materia.',NULL);
INSERT INTO attribute_desc VALUES(86,2,'es','F(R*,T)','$F(\Re,T_{\mu\nu})$','La acción también puede pensarse en función del escalar de Ricci afín y la traza del tensor de estrés-energía-momento.',NULL);
INSERT INTO attribute_desc VALUES(87,2,'es','F(R,Lm)','$F(R,\mathcal{L}_{matt})$','La acción es una función del escalar de Ricci y el Lagrangiano de materia.',NULL);
INSERT INTO attribute_desc VALUES(88,2,'es','F(R,T)','Función de Acción','La acción es una función del escalar de Ricci y la traza del tensor de energía-momentum.',NULL);
INSERT INTO attribute_desc VALUES(89,1,'es','Teoría de Campos','Teoría de Campos','Cualquier teoría que contenga el concepto matemático de campo (un imponderable extendido que no se puede transformar).',NULL);
INSERT INTO attribute_desc VALUES(90,2,'es','Conexión Plana','$\overline{\nabla}$: Conexión plana','Derivada para espacios planos.',NULL);
INSERT INTO attribute_desc VALUES(91,1,'es','Fuerza Inter-partículas','Fuerza inter-partículas','Cada $F^{i}\in\left\{ F^{i}\right\} $ es un vector real evaluado en $\Sigma\times\Sigma\times K\times E^{3}\times T$.<br>El valor de $F^{i}$ en una séptupla dada $\left\langle \sigma,\sigma'',k,x,t\right\rangle $ representa la fuerza ejercida por $\sigma''$ on $sigma$ relativa a $k$ en $x$ y $t$.',NULL);
INSERT INTO attribute_desc VALUES(92,1,'es','Densidad de fuerza E.M.','Densidad de fuerza electromagnética','La densidad de fuerza ejercida por un campo externo $\left\langle E,B\right\rangle \hat{=}$ $\phi\in\Phi$ en $\sigma\in \Sigma$ es<br>$f=\rho\left(E+\frac{v}{c}\times B\right)$.',NULL);
INSERT INTO attribute_desc VALUES(93,2,'es','G 5-101','Constante gravitacional',NULL,NULL);
INSERT INTO attribute_desc VALUES(94,2,'es','G 5-38','Constante gravitacional',NULL,NULL);
INSERT INTO attribute_desc VALUES(95,2,'es','G 5-61','Constante gravitacional',NULL,NULL);
INSERT INTO attribute_desc VALUES(96,2,'es','G 5-63','Constante gravitacional',NULL,NULL);
INSERT INTO attribute_desc VALUES(97,2,'es','G 5-65','Constante gravitacional',NULL,NULL);
INSERT INTO attribute_desc VALUES(98,2,'es','G 5-70','Constante gravitacional',NULL,NULL);
INSERT INTO attribute_desc VALUES(99,2,'es','G 5-89','Constante Gravitational',NULL,NULL);
INSERT INTO attribute_desc VALUES(100,2,'es','G = 1','Constante Gravitacional',NULL,NULL);
INSERT INTO attribute_desc VALUES(101,1,'es','Componentes','Tipificación de los componentes de $\mathrm{T}$ ','Los componentes de $\mathrm{T}$ son funciones de valor real de $\bar{\sigma}$, $k$, $X$ y $t$.<br>Los componentes de $\mathrm{T}$ desaparecen fuera de $V$.',NULL);
INSERT INTO attribute_desc VALUES(102,1,'es','Equivalencia de marcos','Equivalencia de marcos de coordenadas','Dos soluciones de la ecuación de Einstein que pueden transformarse entre sí mediante una transformación de coordenadas admisible se refieren al mismo campo.',NULL);
INSERT INTO attribute_desc VALUES(103,1,'es','Invariancia Galileana','Invariancia Galileana','Las leyes básicas de la física serán invariantes bajo transformaciones de coordenadas que representan cambios de marcos inerciales (galileanos).',NULL);
INSERT INTO attribute_desc VALUES(104,2,'es','Acción General','Acción general métrica',NULL,NULL);
INSERT INTO attribute_desc VALUES(105,2,'es','Acción General a la Palatini','Acción general a la Palatini',NULL,NULL);
INSERT INTO attribute_desc VALUES(106,1,'es','Teoría General de Sistemas','Teoría General de Sistemas','Un conjunto de conceptos y principios interrelacionados que se aplican a todos los sistemas.',NULL);
INSERT INTO attribute_desc VALUES(107,1,'es','Covarianza General','Covarianza General','Los enunciados de las leyes básicas de la física deben cumplirse en cualquier marco de referencia y en cualquier sistema de coordenadas. Deben conservarse bajo cambios arbitrarios en los sistemas de coordenadas, ya sea que estos últimos reflejen o no diferentes marcos de referencia físicos.',NULL);
INSERT INTO attribute_desc VALUES(108,2,'es','Ley Geodésica','Ley Geodésica','Las partículas libres siguen las geodésicas de la línea tipo tiempo de la conexión.',NULL);
INSERT INTO attribute_desc VALUES(109,1,'es','Campos Gravitacionales','Campos gravitatorios','$\Sigma$ es un conjunto no vacío.<br>Cada $\Sigma$ representa un campo gravitacional.',NULL);
INSERT INTO attribute_desc VALUES(110,2,'es','Fuerza Gravitacional','Fuerza Gravitacional','Las partículas afectadas sólo por fuerzas gravitacionales siguen curvas no geodésicas determinadas por el potencial gravitacional.',NULL);
INSERT INTO attribute_desc VALUES(111,2,'es','H2*K = H2*K','Propiedad de simetría','Esta ecuación de campo indica que la forma en que el espacio se curva debido a los efectos gravitacionales es la misma, independientemente del orden en que se consideren diferentes posiciones o coordenadas.',NULL);
INSERT INTO attribute_desc VALUES(112,1,'es','Hamiltoniano','Hamiltoniano','Operador o función matemática que codifica la energía total de un sistema físico. Normalmente se define en términos de las coordenadas generalizadas del sistema y sus momentos conjugados. El representa la suma de las energías cinética y potencial del sistema.',NULL);
INSERT INTO attribute_desc VALUES(113,2,'es','Hyp','Hypermomentum','Cantidad que representa la variación de la acción de materia SM con respecto a la conexión, lo que imita la definición del tensor de estrés-energía-momentum.',NULL);
INSERT INTO attribute_desc VALUES(114,2,'es','Independente','Independencia de variables','La conexión $\Gamma_{\mu\nu}^{\lambda}$ puede expresarse de forma independiente al tensor métrico $g_{\mu\nu}$.',NULL);
INSERT INTO attribute_desc VALUES(115,1,'es','Marco Inercial','Marcos de referencia inerciales','$I\neq\emptyset\land I\subset\Sigma-S$.<br>Cada $i\in I$ es un marco de referencia inercial.<br>Para cada $i\in I$ hay una base $e=\left\langle e_{1},e_{2}.e_{3}\right\rangle $ tal que $e\hat{=}i$.',NULL);
INSERT INTO attribute_desc VALUES(116,1,'es','Fuerza entre Partículas','Fuerza entre partículas','Cada $F^{i}\in\left\{ F^{i}\right\} $ es un vector real evaluado en $\Sigma\times\Sigma\times K\times E^{3}\times T$.<br>El valor de $F^{i}$ en una séptupla dada $\left\langle \sigma,\sigma'',k,x,t\right\rangle $ representa la fuerza ejercida por $\sigma''$ sobre $\sigma$ relativa a $k$ en $x$ y $t$.',NULL);
INSERT INTO attribute_desc VALUES(117,1,'es','K','Conjunto de marcos de referencia físicos','$K$ es un conjunto numerable no vacío.<br>Cada $k$ es un sistema rígido de corpúsculos de los cuáles por lo menos cuatro descansan en los vértices de un trihedro regular.<br>Para cada $k$ existe un sistema cartesiano de ejes $e=\left\langle e_{1},e_{2}.e_{3}\right\rangle $ tal que $e\hat{=}k$<br>Ninguna $k$ interactúa con ninguna $\sigma\subset\Sigma$ que no sea parte de $k$.<br>La configuración de cada$k\in K$ es independiente del tiempo.',NULL);
INSERT INTO attribute_desc VALUES(119,2,'es','K0','$K_{0}$','Parámetro de coincidencia cosmológica.',NULL);
INSERT INTO attribute_desc VALUES(120,2,'es','Kappa1, Kappa2','$\kappa_{1}$, $\kappa_{2}$: Funciones arbitrarias',NULL,NULL);
INSERT INTO attribute_desc VALUES(121,2,'es','Km','$K^{\mu}$: Campo vectorial dinámico','Campo vectorial dinámico tipo tiempo.',NULL);
INSERT INTO attribute_desc VALUES(122,1,'es','Lagrangiano','Lagrangiano','Un Lagrangiano es una función matemática que resume la dinámica de un sistema físico. Normalmente se define como la diferencia entre la energía cinética y la energía potencial del sistema, expresada en términos de las coordenadas generalizadas del sistema y sus derivadas temporales.',NULL);
INSERT INTO attribute_desc VALUES(123,2,'es','lambda','Función cosmológica $\lambda(\phi)$','$\lambda(\phi)$ provoca dos efectos: en la ecuación de campo para $g$ juega el mismo papel que la constante cosmológica en GR y, en la ecuación de campo, da a $(\phi)$ un rango l relacionado con $\lambda$, $w$ y sus derivados, en el sentido de que las soluciones para $(\phi)$ para un sistema aislado contienen términos tipo Yukawa $exp\left(-r/l\right)$.',NULL);
INSERT INTO attribute_desc VALUES(124,2,'es','lambda = 0','$\lambda(\phi)=0$',NULL,NULL);
INSERT INTO attribute_desc VALUES(125,2,'es','Local','Localidad','La materia es una función puntual. La acción es función únicamente de la métrica y de un número finito de sus derivadas.',NULL);
INSERT INTO attribute_desc VALUES(126,1,'es','Localidad','Localidad','Para cualquier punto $x\in M^{4}$ existe una vecindad de $x$ sobre la cual se puede dar un sistema de coordenadas local tal que $x^{0}$ es una coordenada de tiempo (local) y $x^ {1}$, $x^{2}$ y $x^{3}$ son coordenadas espaciales (locales).<br>Aproximadamente: el espacio tangente de $M^{4}$ en cualquier $x\in M^{4}$ es el espacio-tiempo.',NULL);
INSERT INTO attribute_desc VALUES(127,1,'es','Lógica','Lógica','El estudio sistemático de reglas válidas de inferencia, análisis y valoración de argumentos.',NULL);
INSERT INTO attribute_desc VALUES(128,1,'es','Invarianza de Lorentz','Invarianza de Lorentz','Las leyes básicas de la física serán invariantes bajo las transformaciones de Lorentz de coordenadas que representan cambios de marcos inerciales.',NULL);
INSERT INTO attribute_desc VALUES(129,2,'es','M','$M$: Variedad diferenciable','1.- El espacio-tiempo tiene topología: dado cualquier punto $p$ en el espacio-tiempo, tenemos la noción de una vecindad de $p$.<br> 2.- El espacio-tiempo es coordinable por $R^{4}$. Ésta es una afirmación puramente local (el espacio-tiempo es localmente euclidiano).',NULL);
INSERT INTO attribute_desc VALUES(130,1,'es','{B}','Variedad que representa cuerpos','$\left\{ B\right\} $ es una familia no vacía de conjuntos de puntos.<br>Todo $b\in B$ es una variedad diferenciable tridimensional.<br>Por cada $\sigma\in\Sigma$ existe un $b\in\beta$ tal que $b\hat{=}\sigma$ puntualmente.',NULL);
INSERT INTO attribute_desc VALUES(131,1,'es','M3','Espacio','$M^{3}$ es una variedad diferenciable 3-dimensional.<br>$M^{3}$ representa el espacio físico.',NULL);
INSERT INTO attribute_desc VALUES(132,1,'es','M4','$M^{4}$: Variedad de 4D','$M^{4}$ es una variedad diferenciable 4-dimensional de clase $C^{2}$.<br>Para cada punto $x\subset M^{4}$, existe una vecindad de $x$ sobre la cual un sistema de coordenadas local puede ser dado (definido).<br>las funciones $f^{\mu}$ que mapean conjuntos de coordenadas vecinas entre sí son continuas y tienen derivadas continuas hasta de segundo orden en $M^{4}$.<br>$M^{4}$ representa el espacio físico.',NULL);
INSERT INTO attribute_desc VALUES(133,1,'es','{B*}','Intensidad del campo magnético','Cada $\left\{ B\right\} $ es una familia de campos no vacía. Cada $B\in\left\{ B\right\} $ función con valor de pseudovector real en $\Phi\times M^{3}\times T$.<br>$B(\phi,x,t)$ representa la intensidad del componente magnético de $\phi$ en $x$,$t$.',NULL);
INSERT INTO attribute_desc VALUES(134,1,'es','Geometría de Variedades','Geometría de Variedades','Rama de la geometría diferencial que estudia espacios topológicos que localmente se asemejan al espacio euclidiano cerca de cada punto.',NULL);
INSERT INTO attribute_desc VALUES(135,1,'es','Lugar','El lugar que ocupa el cuerpo','Por cada $X\in\left\{ X\right\}$, cada $b\in\beta$ y cada $t\in T$, el mapa $X:b\rightarrow C$ es 1:1, sobre y continuo.<br>Por cada $X\in\left\{ X\right\}$, cada $b\in\beta$ y cada $t\in T$ la imagen $C=X(b,t)$ de $b$ bajo $X$ es un conjunto compacto con un límite continuo por partes $\partial X(b,t)$.<br>Por cada $\sigma\in\Sigma$ y $t\in T$ existe un $X\in\left\{ X\right\} $ tal que la imagen $X(b,t)$ de $b$ bajo $X$ representa el lugar que ocupa el cuerpo $\sigma$ representado por $b$.',NULL);
INSERT INTO attribute_desc VALUES(136,1,'es','Masa','$M$: masa','Función de $\Sigma$ al conjunto $\mathbb{R^{+}}$ de reales no negativos.<br>El valor de $M$ en $\sigma,\in\Sigma$ representa la masa (inertia) de $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(137,1,'es','Aditividad de la Masa','Aditividad de la masa','Para cada $\sigma\in\Sigma$, si $b\hat{=}\sigma$ y $C$ es la imagen de $b$ debajo de $X$, entonces $M$ es una función continua del volumen ( Medida de Lebesgue) $\mu(b,t)$ de $b$ en $t$.<br>b) Para cualesquiera dos $\sigma,\sigma''\in\Sigma$ distintos, si $b\hat{=}\sigma$ y $b''\hat{=}\sigma''$, y $b\cup b ''\hat{=}\sigma+\sigma''$, entonces $M(b\cup b'')=M(b)+M(b'')$.<br>c) Si $b\hat{=}c$, entonces $M(b)$ representa la masa de $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(138,1,'es','Conservación de Masa','Conservación de masa','Para cada $\sigma\in\Sigma$, si $b\hat{=}\sigma$ y $C=X(b,t)$ y $C’ =X’(b)$ son dos configuraciones diferentes de $\sigma$ en un momento dado $t$, entonces las masas correspondientes son la misma: $M(\sigma)=\underset{X(b)}{\int}d^{3}x\rho_{X}=\underset{X’(b)}{\int}d^{3}x\rho_{X’}$.',NULL);
INSERT INTO attribute_desc VALUES(139,1,'es','Densidad de Masa','Densidad de masa','Cada $\rho\in\left\{ \rho\right\} $ es una función continua y acotada de $\beta$ al conjunto de los reales no negativos.<br>Si $b\hat{=}\sigma$, entonces $\rho(b,x,t)$ representa la densidad de masa de $\rho$ en $x$,$t$.',NULL);
INSERT INTO attribute_desc VALUES(140,1,'es','Indiferencia Material','Indiferencia Material','O la objetividad. Las ecuaciones constitutivas deben ser invariantes bajo transformaciones de coordenadas.',NULL);
INSERT INTO attribute_desc VALUES(141,1,'es','Estadística Matemática','Estadística Matemática','La aplicación de la teoría de la probabilidad a la estadística.',NULL);
INSERT INTO attribute_desc VALUES(142,1,'es','Ec. de Maxwell','Ecuaciones de Maxwell','En cualquier punto $x\in M^{3}$ y cualquier instante $t\in T$, para cada campo $\phi\in \Phi$ y cada cuerpo cargado $\sigma\in \Sigma$, existe un $k\in K$ tal que<br>$\nabla\times E=-\frac{1}{c}\frac{\partial B}{\partial t}$, $\nabla\cdot B=0$ y <br>$\nabla\times B=-\frac{1}{c}\frac{\partial E}{\partial t}+\frac{4\pi}{c}j$, $\nabla\cdot E=4 \pi\rho$.',NULL);
INSERT INTO attribute_desc VALUES(143,2,'es','Conexión Métrico-Afín','$\Gamma*$: Conexión afín independiente','Una conexion para espacios métrico-afines donde la no-metricidad y la torsión son distintas de cero.',NULL);
INSERT INTO attribute_desc VALUES(144,2,'es','Conexión Métrica','Conexión métrica','También llamada la conexión Levi-Civita, es dependiente de la métrica $g$. Nos da información acerca de cómo transportar vectores a lo largo de una curva conservando la métrica.',NULL);
INSERT INTO attribute_desc VALUES(145,2,'es','Tensor Métrico','$g_{\mu\nu}$: Tensor métrico','Un campo tensorial simétrico de tipo $(0,2)$. Provee una noción de distancia y ángulo entre vectores. Nos habla de la curva más corta.',NULL);
INSERT INTO attribute_desc VALUES(145,1,'es','Tensor Métrico','$g_{\mu\nu}$: Tensor métrico','$\left\{ g\right\} $ es una familia no vacía de campos tensoriales simétricos, de valencia (0,2), en $M^{4}$<br>Los componentes de $g$ y sus derivados primero y segundo w.r.t. los $x^{\mu}$ tienen valores reales y están acotados en cada $V\subset M^{4}$ con la posible excepción de un subconjunto propio de $V$.<br> $M^{4}$ está dotado de una métrica $ds^{2}=g_{\mu\nu}dx^{\mu}dx^{\nu}$ con $\mu,\nu=0,1 ,2,3$.',NULL);
INSERT INTO attribute_desc VALUES(146,1,'es','Momento del Momentum','Ley del momento del momentum','Por cada $\sigma\in\Sigma$, cada $t\in T$, cada $\rho\in\left\{ \ho\right\} $, cada $f_{b}\in\left\{ f_{b}\right\} $, y cada $\mathrm{T\in\left\{ \mathrm{T}\right\} }$, existe una $k\in K$ tal que $\dot{L}=N$.',NULL);
INSERT INTO attribute_desc VALUES(147,2,'es','N','Dimensión: $N=4$','La dimensión de una variedad es la cardinalidad de las n-tuplas de números reales que representan puntos en la variedad.',NULL);
INSERT INTO attribute_desc VALUES(148,2,'es','Conexión Newton-Cartan','$\nabla$: Conexión Newton-Cartan','Conexión plana covariante.',NULL);
INSERT INTO attribute_desc VALUES(149,1,'es','Campos no Gravitacionales','Campos no Gravitacionales','$\overline{\Sigma}$ es un conjunto no vacío disjunto de sigma.<br>Cada $\overline{\Sigma}$ representa un sistema físico distinto al campo gravitacional.',NULL);
INSERT INTO attribute_desc VALUES(150,2,'es','No-Metricidad','Tensor de no-metricidad','Mide la falla de la conexión de conservar de forma covariante la métrica.',NULL);
INSERT INTO attribute_desc VALUES(151,2,'es','No-Metricidad = 0','No-metricidad = 0','Segunda condición de homogeneidad de Trautman.',NULL);
INSERT INTO attribute_desc VALUES(153,2,'es','No Local','No-localidad','La materia es función de la densidad. La no localidad entra a través de correcciones cuánticas a las ecuaciones de campo efectivo de bucles de gravitones sin masa. Estos no inducen ninguna no localidad macroscópica en el fondo del espacio plano porque sus interacciones son suprimidas por derivados.',NULL);
INSERT INTO attribute_desc VALUES(154,2,'es','Signatura no toda Positiva','Clase de signatura','Para el tensor métrico: no definitivamente positiva: $<-,+,+,+>$ o $<+,-,-,->$',NULL);
INSERT INTO attribute_desc VALUES(155,1,'es','Eventos','Eventos y trayectoria del movimiento','Para cada $\sigma\in\Sigma$, y cada $k\in K$, cada $X\in\left\{ X\right\} $ es una función continua y de valor real de $T$ a $E^ {3}$<br>Para cada $\sigma\in\Sigma$ y cada $k\in K$, $\dot{X}$ es una función continua por partes y de valor real desde $T$ hasta $E^{3}$.<br>$X(\sigma,k,t)$ representa la posición de $\sigma$, relativa al marco $k$ en el instante $t$.<br>Cada quíntuple $\left\langle \sigma,X_{1},X_{2},X_{3},t\right\rangle $ representa un evento.<br>Para cualquier $\sigma\in\Sigma $ y cualquier $k\in K$ dado, el conjunto $\left\{ X(\sigma,k,t)\mid t\in T\right\} $representa un trayectoria (movimiento) de $\sigma$.',NULL);
INSERT INTO attribute_desc VALUES(156,1,'es','Identificación','Identificación','Para cualquiera dos $\sigma$,$\sigma''\in\Sigma$ y cada $k\in K$ y cada $t’\in T$, si $X\left(\sigma,t,k\right)=X\left(\sigma'',t,k\right)$ y $\dot{X}\left(\sigma,t,k\right)=\dot{X}\left(\sigma'',t,k\right)$, entonces $\sigma=\sigma’$.<br>Los valores de la posición y la velocidad identifican de manera única (caracterizan) a las partículas. Las coordenadas por sí solas son insuficientes para esto: por lo tanto, dos partículas diferentes pueden estar en el mismo lugar en el instante de la colisión, pero luego tendrán velocidades (vectoriales) diferentes.',NULL);
INSERT INTO attribute_desc VALUES(157,1,'es','Aditividad','Aditividad de las masas','La masa de un sistema de partículas puntuales es igual a la suma de las masas parciales.<br>Si $\sigma_{i}\in\Sigma$ para cada $i\in N$ finito, entonces $M\left(\underset{i}{\dot{\sum}}\sigma_{i}\right) =\underset{i}{\sum}M(\sigma_{i})$.',NULL);
INSERT INTO attribute_desc VALUES(158,1,'es','Partículas','Partículas puntuales','$\Sigma$ es un conjunto numerable no vacío.<br>Cada $\Sigma$ is una partícula.',NULL);
INSERT INTO attribute_desc VALUES(159,1,'es','Espacio Fase','Espacio fase','Un conjunto de coordenadas, donde cada coordenada corresponde a un grado de libertad del sistema, y cada punto en el espacio de fase representa un estado único del sistema en un instante particular en el tiempo.',NULL);
INSERT INTO attribute_desc VALUES(160,2,'es','Phi','$\phi$: Campo escalar dinámico',NULL,NULL);
INSERT INTO attribute_desc VALUES(161,2,'es','Phi0','$\phi_{0}$','Parámetro de coincidencia cosmológica.',NULL);
INSERT INTO attribute_desc VALUES(162,1,'es','Geometría Física Euclidiana','Geometría Física Euclidiana','Geometría euclidiana con una interpretación física. Se mantiene razonablemente bien para pequeñas regiones del espacio.',NULL);
INSERT INTO attribute_desc VALUES(163,1,'es','Geometría Física','Geometría Física','Una teoría geométrica da diferentes significados físicos a las primitivas de la teoría abstracta D de los espacios métricos.',NULL);
INSERT INTO attribute_desc VALUES(164,1,'es','Teoría Física de Probabilidad','Teoría Física de Probabilidad','Teoría de la probabilidad matemática más una interpretación física de sus primitivas U y P.',NULL);
INSERT INTO attribute_desc VALUES(165,1,'es','Coordenadas Físicas','Coordenadas Físicas','Identifican cosas físicas y son relativas a algún marco físico. No deben confundirse con el sistema de coordenadas geométricas.',NULL);
INSERT INTO attribute_desc VALUES(166,1,'es','Sistemas físicos','Sistema físico (material o no)','$\Sigma\neq\textrm{Ø}$.<br>Cada $\sigma\subset\Sigma$ representa un sistema físico.',NULL);
INSERT INTO attribute_desc VALUES(167,1,'es','Poissoniana','Poisson','$P$ campo tensorial en el espacio fase. $P$ habla del sistema físico.',NULL);
INSERT INTO attribute_desc VALUES(168,2,'es','Ec. de Poisson','Ec. de Poisson','Esta ecuación describe el potencial gravitacional Φ en términos de densidad de masa ρ y la constante gravitacional G.',NULL);
INSERT INTO attribute_desc VALUES(169,2,'es','Ec. de Poisson 2','Ec. de Poisson ','En la teoría Newton-Cartan, esta ecuación relaciona el tensor de Ricci con la densidad de masa ρ y la constante gravitacional G.',NULL);
INSERT INTO attribute_desc VALUES(170,1,'es','Persistencia','Una vez partícula, siempre partícula.','Para dos $t$ diferentes, $t''\in T$, o $\sigma\in\Sigma$ en $t$, tenemos $\sigma\subset\Sigma$ en $t''$.<br>Se necesita este postulado para garantizar las predicciones y retrodicciones calculadas para una $Sigma$ en leyes de movimiento y cualquier condición inicial referirá a $Sigma$.',NULL);
INSERT INTO attribute_desc VALUES(171,1,'es','Teoría de Probabilidad','Teoría de Probabilidad','Rama de las matemáticas que se ocupa de la probabilidad como un concepto matemático riguroso expresado en un conjunto de axiomas.',NULL);
INSERT INTO attribute_desc VALUES(172,2,'es','Psi','$\psi$: Campos de materia','$\psi$ representa un símbolo colectivo para varios campos o grados de libertad de la materia. Estos campos podrían representar diferentes tipos de materia o cantidades físicas, como campos escalares, campos vectoriales o campos de espinores, según la teoría específica. Describen las propiedades de la materia física o los campos que interactúan con el campo gravitacional representado por la métrica.',NULL);
INSERT INTO attribute_desc VALUES(173,2,'es','R = 0','$R=0$','El escalar de Ricci es cero.',NULL);
INSERT INTO attribute_desc VALUES(174,2,'es','R = Cte','$R=Cte$','El escalar de Ricci es constante.',NULL);
INSERT INTO attribute_desc VALUES(176,2,'es','R*','$\Re$: Escalar de Ricci afín','El escalar de Ricci afín es la traza del tensor de Ricci con respecto a la métrica y la conección afín. El tensor de Ricci está definido como: $\Re_{\mu\nu}:=\Gamma_{\mu\nu,\lambda}^{*\lambda}-\Gamma_{\mu\lambda,\nu}^{*\lambda}+\Gamma_{\mu\nu}^{*\rho}\Gamma_{\rho\lambda}^{*\lambda}-\Gamma_{\mu\lambda}^{*\rho}\Gamma_{\nu\rho}^{*\lambda}$.',NULL);
INSERT INTO attribute_desc VALUES(177,1,'es','Marco de Referencia','Marco de Referencia','$K$ es un conjunto no vacío numerable.<br>Cada $k$ es un sistema rígido de corpúsculos de los cuáles al menos cuatro se encuentran en los vértices de un tetrahedro regular.<br>Por cada $k$ existe un sistema cartesiano de ejes $e=\left\langle e_{1},e_{2}.e_{3}\right\rangle $ tal que $e\hat{=}k$.<br>Ningún $k$ interactúa con ningún otro $\sigma\subset\Sigma$ que no sea parte de $k$.<br>La configuración de cada $k\in K$ es independiente del tiempo.',NULL);
INSERT INTO attribute_desc VALUES(178,2,'es','Escalar de Ricci','$R$: Escalar de Ricci','El escalar de Ricci es la traza del tensor de Ricci con respecto a la métrica y da una medida de la curvatura del espacio.',NULL);
INSERT INTO attribute_desc VALUES(179,2,'es','SM1','Acción de materia','La acción de la materia, $S_{M}$, cuantifica la dinámica y las interacciones de la materia. Es funcional, lo que significa que asigna un conjunto de campos (en este caso, $g_{\mu\nu}$ y $\psi)$ a un número real, que normalmente representa una acción o densidad lagrangiana.',NULL);
INSERT INTO attribute_desc VALUES(180,2,'es','SM2','Acción afín de materia','La acción de la materia, $S_{M}$, cuantifica el comportamiento de los campos de materia $\psi)$, sus interacciones con la métrica $(g_{\mu\nu}$ y su acoplamiento a los coeficientes de conexión afines $\Gamma_{\mu\nu}^{\lambda}$.',NULL);
INSERT INTO attribute_desc VALUES(181,1,'es','Semántica','Semántica','El estudio sistemático del significado en el lenguaje, la lógica formal y la semiótica.',NULL);
INSERT INTO attribute_desc VALUES(182,1,'es','Teoría de Conjuntos','Teoría de Conjuntos','Teoría de colecciones de objetos matemáticos.',NULL);
INSERT INTO attribute_desc VALUES(184,1,'es','Contigüidad del Espacio-Tiempo','Contigüidad del Espacio-Tiempo','Solo las regiones de campo conectables por una perturbación de campo (por lo tanto, separadas por un intervalo de tiempo) pueden interactuar.',NULL);
INSERT INTO attribute_desc VALUES(185,1,'es','Sistema de Partículas','Sistema de partículas','Una colección de partículas individuales que interactúan unas con otras de alguna manera.',NULL);
INSERT INTO attribute_desc VALUES(186,2,'es','Tmn','$T_{\mu\nu}$: Tensor de Estrés-Energía-Momentum','Un campo tensor simétrico $(2,0)$ que representa el momento de energía de la distribución de masa, con contribuciones específicas de densidad de energía de las interacciones dictadas por las teorías.',NULL);
INSERT INTO attribute_desc VALUES(187,2,'es','T = 0','Polvo','El tensor de Estrés-Energía-Momentum es casi cero (modelos de polvo).',NULL);
INSERT INTO attribute_desc VALUES(188,1,'es','Teoría de Espacios Riemannianos','Teoría de Espacios Riemannianos','Rama de la geometría diferencial que estudia variedades suaves con métrica riemanniana.',NULL);
INSERT INTO attribute_desc VALUES(189,1,'es','Teoría del Tiempo Universal','Teoría del Tiempo Universal','Una teoría que asume un único tiempo relacional para cada lugar y cada marco de referencia.',NULL);
INSERT INTO attribute_desc VALUES(190,1,'es','Teoría del Tiempo Local','Teoría del Tiempo Local','Una teoría del tiempo relacional con diferentes marcos inerciales.',NULL);
INSERT INTO attribute_desc VALUES(191,1,'es','Tiempo','Tiempo','$T$ es un intervalo de línea real.<br>Cada $t$ representa un instante de tiempo.<br>La relación $\leq$ que ordena $T$ significa “más temprano que, o simultáneo a”.',NULL);
INSERT INTO attribute_desc VALUES(192,1,'es','Rango de Tiempo','tR: El rango de la función de hora local','$T$ es un intervalo de línea real<br>$T$ es el rango de la función de tiempo que satisface los axiomas de la teoría del tiempo local.<br>Cada subconjunto $t\subset T$ representa un instante de tiempo t.',NULL);
INSERT INTO attribute_desc VALUES(193,1,'es','Topología','Topología','El estudio de las propiedades de los objetos geométricos que se conservan bajo deformaciones continuas, como estirarse, torcerse, arrugarse y doblarse, pero no desgarrarse ni pegarse.',NULL);
INSERT INTO attribute_desc VALUES(194,2,'es','Torsión','Tensor de torsión de Cartan','La parte antisimétrica de la conexión.',NULL);
INSERT INTO attribute_desc VALUES(195,2,'es','Torsión = 0','Torsión = 0','El tensor de torsión de Cartan se desvanece. Condición de homogeneidad de Trautman. $\widetilde{R}_{bd}^{ac}=\widetilde{R}_{db}^{ca}$.',NULL);
INSERT INTO attribute_desc VALUES(197,1,'es','Convergencia Uniforme','Convergencia Uniforme','Todas las series cuyos términos representan objetos físicos serán uniformemente convergentes en el intervalo dado.',NULL);
INSERT INTO attribute_desc VALUES(198,2,'es','V','$V$: Campo contravectorial','Para describir el espacio absoluto introducimos un campo vectorial tangente $V$. Las curvas $\sigma$ que se ajustan a $V-T_{\sigma}=V$ a lo largo de $\sigma$ son las líneas de acordonamiento.',NULL);
INSERT INTO attribute_desc VALUES(199,1,'es','Teoría de Espacios Vectoriales','Teoría de Espacios Vectoriales','Teoría de la suma y multiplicación de espacios vectoriales.',NULL);
INSERT INTO attribute_desc VALUES(200,1,'es','Velocidad y aceleración','Velocidad y aceleración','Las derivadas $\dot{X}$ y $\ddot{X}$ existen y están acotadas para cada $X\in\left\{ X\right\} $, cada $\beta\in b$, cada $k \in K$ y cada $t\in T$.<br>Si $\beta\hat{=}\pi$ y $\pi\dot{\in}\sigma$, entonces $\dot{X}(\beta,k,t)$ y $\ddot{X}( \beta,k,t)$ representan la velocidad y la aceleración respectivamente de la partícula $\pi$ en el cuerpo $\sigma$ en relación con el marco en el tiempo $t$.',NULL);
INSERT INTO attribute_desc VALUES(201,2,'es','Vector de Weyl','Vectror de Weyl','La traza del tensor de no-metricidad con respecto a sus dos últimos índices simétricos.',NULL);
INSERT INTO attribute_desc VALUES(202,2,'es','Vector de Weyl = 0','El vector de Weyl se desvanece','La traza del tensor de no metricidad con respecto a sus dos últimos índices (simétricos) es igual a cero.',NULL);
INSERT INTO attribute_desc VALUES(203,2,'es','Xi','Tensor de Mendoza ','Donde $L_{M}^{2}$ define una longitud fijada por los parámetros de la teoría: $L_{M}:=\zeta(\frac{GM}{a_{0}^{3}})^{\frac{1}{4}}$.',NULL);
INSERT INTO attribute_desc VALUES(204,2,'es','a, b, c, d','$a$, $b$, $c$, $d$','Parámetros de coincidencia cosmológica.',NULL);
INSERT INTO attribute_desc VALUES(205,2,'es','a, f, k','Parámetros arbitrarios',NULL,NULL);
INSERT INTO attribute_desc VALUES(206,2,'es','a0','Constante de Milgrom','Escala de aceleración. Los sistemas que experimenten aceleraciones menores a $a_{0}$ mostrarán una dinámica no estándar.',NULL);
INSERT INTO attribute_desc VALUES(207,1,'es','c','c','Una constante que representa la magnitud de la velocidad de las señales electromagnéticas en el vacío. Es un número real positivo tal que $\left[c\right]=LT^{-1}$.<br>Cada $s\in S$ se propaga en el vacío, relativo a cualquier $i\in I$, con movimiento rectilíneo uniforme a la velocidad $c$.',NULL);
INSERT INTO attribute_desc VALUES(208,2,'es','c0, c1','$C_{0}$, $C_{1}$','Parámetros cosmológicos. En el marco de reposo del universo, g tiene la forma asintótica $diag(-c_{0},c_{1},c_{1},c_{1})$, donde $c_{0}$ y $c_{1 }$ pueden variar en la escala de tiempo del Hubble.',NULL);
INSERT INTO attribute_desc VALUES(209,2,'es','dt','$dt$: Función de tiempo','Un covector que induce una foliación de la variedad M en hyper-superficies de tres dimensiones.',NULL);
INSERT INTO attribute_desc VALUES(210,2,'es','dt(V) = 1','Requisito de curvas temporales','Esta condición se introduce para garantizar que las curvas $\sigma$ sean temporales. La cantidad $dt(V)$ representa la tasa de cambio del tiempo a lo largo de las curvas experimentada por un observador que se mueve a lo largo de V. Requerir $dt(V)=1$ garantiza que las curvas avancen en el tiempo de acuerdo con el tiempo absoluto estándar.',NULL);
INSERT INTO attribute_desc VALUES(211,2,'es','e','$e$: Función arbitraria',NULL,NULL);
INSERT INTO attribute_desc VALUES(212,2,'es','e = 0','$\epsilon=0$',NULL,NULL);
INSERT INTO attribute_desc VALUES(213,2,'es','e = 1','$\epsilon=1$',NULL,NULL);
INSERT INTO attribute_desc VALUES(214,2,'es','epsilon','$\epsilon$','Parámetro arbitrario.',NULL);
INSERT INTO attribute_desc VALUES(215,2,'es','eta','$\eta$: Métrica de Minkowski','Métrica plana no dinámica. Dado que $Riem(\Gamma)=0$, siempre podemos elegir coordenadas globales en las que $\eta_{\mu\nu}=diag(-1,1,1,1)$.',NULL);
INSERT INTO attribute_desc VALUES(216,2,'es','f(R) = R','$f(R)=R$','La función dependiente del escalar de Ricci es de primer orden.',NULL);
INSERT INTO attribute_desc VALUES(217,2,'es','f(R) ≠ R','$f(R)≠R$','La función dependiente del escalar de Ricci es de orden superior.',NULL);
INSERT INTO attribute_desc VALUES(218,2,'es','f(R*) = R*','$f(R^{*})=R^{*}$','La función del escalar de Ricci afín es de primer orden.',NULL);
INSERT INTO attribute_desc VALUES(219,2,'es','f(R*) ≠ R*','$f(R^{*})\neq R^{*}$','La función del escalar de Ricci afín es de orden superior.',NULL);
INSERT INTO attribute_desc VALUES(220,2,'es','f1(Phi), f2(Phi), f3(Phi)','Funciones arbitrarias',NULL,NULL);
INSERT INTO attribute_desc VALUES(221,2,'es','f’(R) =1','$f’(R)=1$','La primera derivada de la función dependiente del escalar de Ricci es igual a uno.',NULL);
INSERT INTO attribute_desc VALUES(222,2,'es','f’(R*) = 1','$f’(R^{*})=1$','La primera derivada del escalar de curvatura afín es igual a uno.',NULL);
INSERT INTO attribute_desc VALUES(223,2,'es','f’’(R) = 0','$f’’(R) =0$','La segunda derivada de la función del escalar de Ricci es cero.',NULL);
INSERT INTO attribute_desc VALUES(224,2,'es','f’’(R) ≠ 0','$f’’(R)\neq 0$','La segunda derivada de la función del escalar de Ricci es distinto de cero.',NULL);
INSERT INTO attribute_desc VALUES(225,2,'es','f’’(R*) = 0','$f’’(R^{*})=0$','La segunda derivada de la función del escalar de Ricci afín es cero.',NULL);
INSERT INTO attribute_desc VALUES(226,2,'es','f’’(R*) ≠ 0','$f’’(R^{*})\neq0$','La segunda derivada de la función del escalar de Ricci afín es distinta de cero.',NULL);
INSERT INTO attribute_desc VALUES(227,2,'es','h','$h$: Tensor métrico plano','Un campo tensor simétrico de tipo $(2,0)$. h se define en el espacio cotangente $T_{p}^{*}\times T_{p}^{*}$ y tiene la signatura $<3,0,1>$. Induce una métrica tridimensional en cada hipersuperficie.',NULL);
INSERT INTO attribute_desc VALUES(228,2,'es','h(dt,w)=0','Ortogonalidad temporal','Condición de ortogonalidad que describe la geometría euclidiana.',NULL);
INSERT INTO attribute_desc VALUES(230,2,'es','k1 = c3/16piG','Constante de acoplamiento',NULL,NULL);
INSERT INTO attribute_desc VALUES(231,2,'es','c','$c$: Velocidad de la luz','Invariancia de la velocidad de señales electromagnéticas. La luz tiene la misma velocidad en todas los marcos de referencia inerciales.',NULL);
INSERT INTO attribute_desc VALUES(232,1,'es','kappa','$\kappa$: constante de Einstein','$\kappa$ es un número real positivo con dimensión $L^{-1}M^{-1}T^{2}$.<br>$\kappa$ representa el acoplamiento de $\sigma$ con $\bar{\sigma}$.',NULL);
INSERT INTO attribute_desc VALUES(233,2,'es','n = -2w','$\eta =-2w$',NULL,NULL);
INSERT INTO attribute_desc VALUES(234,2,'es','n = 0','$n=0$',NULL,NULL);
INSERT INTO attribute_desc VALUES(235,2,'es','n0','$n$','Parámetro arbitrario. También encontrado como $\eta$.',NULL);
INSERT INTO attribute_desc VALUES(236,2,'es','r, q','$r$, $q$','Parámetros arbitrarios.',NULL);
INSERT INTO attribute_desc VALUES(237,2,'es','t','$t$: Función del tiempo cósmico','"Un campo escalar no dinámico. El gradiente de $t$ es covariantemente constante y temporal con respecto a $\eta$. Este campo escalar selecciona secciones espaciales preferidas de ""estratos"" en el universo que son ortogonales a $\nabla$."',NULL);
INSERT INTO attribute_desc VALUES(238,2,'es','tau','$\tau$','Parámetro arbitrario.',NULL);
INSERT INTO attribute_desc VALUES(239,2,'es','tau = 0','$\tau=0$','En este caso, no se impone ninguna restricción al campo vectorial.',NULL);
INSERT INTO attribute_desc VALUES(240,2,'es','tau = 1','$\tau=1$','Esto representa una restricción sobre el calibre del campo vectorial $k_{\mu}$ impuesta por la falta de invariancia de calibre total de la acción $I$.',NULL);
INSERT INTO attribute_desc VALUES(241,2,'es','w','$w(\phi)$: Función arbitraria de acoplamiento',NULL,NULL);
INSERT INTO attribute_desc VALUES(242,2,'es','w = 0','$w=0$',NULL,NULL);
INSERT INTO attribute_desc VALUES(243,2,'es','w-inf','$w\rightarrow\infty$',NULL,NULL);
INSERT INTO attribute_desc VALUES(244,2,'es','w0, w1','$w_{0}, w_{1}$','Parámetros de coincidencia cosmológica.',NULL);
INSERT INTO attribute_desc VALUES(245,2,'es','w’ = 0','$w’=0$',NULL,NULL);
INSERT INTO attribute_desc VALUES(246,1,'es','{XGR}','{XGR}: Posición de un sistema puntual','Para cada $i=1,2,3$, $\left\{ X_{i}\right\} $ es una familia no vacía de funciones.<br>Cada $X_{i}\in\left\{ X_{i}\right\} $ es una función de $\overline{\Sigma}\times K\times T$ a $\mathbb{R}$, continua con respecto a $t$.<br>$X(\bar{\sigma},k,t)$ representa la posición de un sistema de puntos $\bar{\sigma}\in\bar{\Sigma}$, que refieren a $k$, en el instante $t$ relativo a $k$.',NULL);
INSERT INTO attribute_desc VALUES(247,1,'es','{XR}','Posición de un sistema ','$\left\{ X\right\} $ es una familia de funciones no vacía.<br>Cada $X\in\left\{ X\right\} $ es una función de $\Sigma\times I\times T$ a $R^{3}$. <br>$X\left(\sigma,i,t\right)$ representa la posición de un sistema de puntos $\sigma\subset\Sigma$, que refiere al marco $\tau$, en el instante $t$ relativo a $\tau$.<br>Para cada evento puntual existe una séptupla $\left\langle \sigma,s,\tau,X_{0},X_{1},X_{2},X_{3}\right\rangle \hat{=}$ evento.',NULL);
INSERT INTO attribute_desc VALUES(248,1,'es','{X}','${X}$: Posición','Familia de funciones vectoriales que representan la posición de una partícula.$X$ es continuo y está acotado para cada $\beta$, $k$ y $t$.<br>$X(\beta,k,t)$ representa el lugar (localización) de la partícula $\pi$ del cuerpo $\sigma$, relativa al marco $k$ en el instante $t$.',NULL);
INSERT INTO attribute_desc VALUES(249,2,'es','Φ','$\Phi$: Potencial gravitacional','Potencial producido por un campo vectorial tipo espacio que representa el campo gravitacional.',NULL);
INSERT INTO attribute_desc VALUES(250,1,'es','Degeneración Tensorial','Degeneración tensorial','Cuando el tensor constitutivo degenera en $(\epsilon,\mu^{-1})$, las ecuaciones de campo se convierten en $\nabla\times E=-\frac{1}{c}\frac{\partial B}{\partial t}$, $\nabla\cdot B=0$,<br>$\nabla\times H=-\frac{1}{c}\frac{\partial D}{\partial t}+\frac{4\pi}{c}j$, $\nabla\cdot D=4 \pi\rho$.',NULL);
INSERT INTO attribute_desc VALUES(251,2,'es','Xi*','Tensor afín de Mendoza','Donde $\Re$ es un escalar de Ricci no tradicional (escalar de Ricci afín) y $L_{M}:=\zeta(\frac{GM}{a_{0}^{3}})^{\frac{1}{4}}$.',NULL);
INSERT INTO attribute_desc VALUES(251,2,'en','Xi*','Mendoza''s affine tensor','Where $\Re$ is a non traditional Ricci scalar (affine Ricci scalar) and $L_{M}:=\zeta(\frac{GM}{a_{0}^{3}})^{\frac{1}{4}}$.',NULL);
INSERT INTO attribute_desc VALUES(252,2,'es','f(Xi)','$f(\chi)$','Una clase de funciones de acción que actúan sobre el tensor de Mendoza $\chi^{*}$. ',NULL);
INSERT INTO attribute_desc VALUES(252,2,'en','f(Xi)','$f(\chi)$','A class of actions as functions of Mendoza''s tensor $\chi$.',NULL);
INSERT INTO attribute_desc VALUES(253,2,'es','f(Xi*)','$f(\chi^{*})$','Una clase de funciones de acción que actúan sobre el tensor afín de Mendoza $\chi^{*}$. ',NULL);
INSERT INTO attribute_desc VALUES(253,2,'en','f(Xi*)','$f(\chi^{*})$','A class of actions as functions of Mendoza''s affine tensor $\chi^{*}$.',NULL);
